INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','Nasz zespół oraz zasady dostawy','conditions, delivery, delay, shipment, pack','<h2>Przesyłki i zwroty</h2>\n<h2>Twoja przesyłka paczki</h2>\n<h2>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.</h2>\n<h2></h2>\n<h2>Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy szczególnej staranności, aby chronić delikatne przedmioty.</h2>\n<h2></h2>\n<h2>Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</h2>','dostawa'),(2,1,1,'Nota prawna','Nota prawna','notice, legal, credits','<h2>Prawny</h2>\n<h2>Kredyty</h2>\n<h2>Koncepcja i produkcja:</h2>\n<h2></h2>\n<h2>Ta witryna internetowa została stworzona przy użyciu oprogramowania open-source PrestaShop™.</h2>','nota-prawna'),(3,1,1,'Zasady użytkowania','Zasady użytkownia','conditions, terms, use, sell','<h2>Twoje warunki użytkowania</h2>\n<h2>Zasada nr 1</h2>\n<h2>Oto treść zasady 1</h2>\n<h2></h2>\n<h2>Zasada 2</h2>\n<h2>Oto treść zasady 2</h2>\n<h2></h2>\n<h2>Zasada 3</h2>\n<h2>Oto treść zasady 3</h2>','zasady-uzytkowania'),(4,1,1,'O nas','Dowiedz sie wiecej o nas','about us, informations','<h2>O nas</h2>\n<h2>Nasza firma</h2>\n<h2>Nasza firma</h2>\n<h2></h2>\n<h2>Nasz zespół</h2>\n<h2>Nasz zespół</h2>\n<h2></h2>\n<h2>Informacje</h2>\n<h2>Informacje</h2>','o-nas'),(5,1,1,'Bezpieczne transakcje','Nasze bezpieczne transakcje','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczna płatność</h2>\n<h2>Nasza bezpieczna płatność</h2>\n<h2>Z SSL</h2>\n<h2></h2>\n<h2>Korzystanie z karty Visa/Mastercard/Paypal</h2>\n<h2>O tych usługach</h2>','bezpieczne-transakcje');
