INSERT INTO `ps_product_lang` VALUES (1,1,1,'This course aims to teach everyone the basics of programming computers using Python. We cover the basics of how one constructs a program from a series of simple instructions in Python.  The course has no pre-requisites and avoids all but the simplest mathematics. Anyone with moderate computer experience should be able to master the materials in this course. This course will cover Chapters 1-5 of the textbook “Python for Everybody”.  Once a student completes this course, they will be ready to take more advanced programming courses. This course covers Python 3.','','crash-course-on-python','','','','Programming for Everybody (Getting Started with Python)','',''),(2,1,1,'Kickstart your learning of Python for data science, as well as programming in general, with this beginner-friendly introduction to Python. Python is one of the world’s most popular programming languages, and there has never been greater demand for professionals with the ability to apply Python fundamentals to drive business solutions across industries.','','python-for-data-science-ai-development','','','','Python for Data Science, AI & Development','',''),(3,1,1,'This course introduces the basics of Python 3, including conditional execution and iteration as control structures, and strings and lists as data structures. You\'ll program an on-screen Turtle to draw pretty pictures. You\'ll also learn to draw reference diagrams as a way to reason about program executions, which will help to build up your debugging skills. The course has no prerequisites. It will cover Chapters 1-9 of the textbook \"Fundamentals of Python Programming,\" which is the accompanying text (optional and free) for this course.','','python-basics','','','','Python Basics','',''),(4,1,1,'Язык программирования Python является одним из самых простых в освоении и популярных языков программирования. Целью курса является изучение основных конструкций языка Python, которые пригодятся при решении широкого круга задач – от анализа данных до разработки новых программных продуктов.','','osnovy-programmirovaniya-na-python','','','','Основы программирования на Python','',''),(5,1,1,'Course Overview: https://youtu.be/JgFV5qzAYno','','python-and-statistics-for-financial-analysis','','','','Python and Statistics for Financial Analysis','',''),(6,1,1,'The goal of the course is to introduce students to Python Version 3.x programming using hands on instruction. It will show how to install Python and use the Spyder IDE (Integrated Development Environment) for writing and debugging programs. The approach will be to present an example followed by a small exercise where the learner tries something similar to solidify a concept.  At the end of each module there will be an exercise where the student is required to write simple programs and submit them for grading.  It is intended for students with little or no programming background, although students with such a background should be able to move forward at their preferred pace.','','python-programming-a-concise-introduction','','','','Python Programming: A Concise Introduction','',''),(7,1,1,'This course provides an introduction to programming and the Python language.  Students are introduced to core programming concepts like data structures, conditionals, loops, variables, and functions.  This course includes an overview of the various tools available for writing and running Python, and gets students coding quickly.  It also provides hands-on coding exercises using commonly used data structures, writing custom functions, and reading and writing to files. This course may be more robust than some other introductory python courses, as it delves deeper into certain essential programming topics.','','introduction-to-python-programming','','','','Introduction to Python Programming','',''),(8,1,1,'Decía Steve Jobs que “todo el mundo debería aprender a programar un ordenador porque esto te ayuda a pensar”. Hoy en día la programación es una herramienta fundamental para el desarrollo de la tecnología moderna. Este curso te introduce en el mundo de la programación en el lenguaje Python. De una forma práctica, aprenderás de forma gradual desde el tratamiento básico de variables hasta la programación de algoritmos para construir tus propios juegos. Además, te familiarizarás con los conceptos fundamentales para el desarrollo de algoritmos y su programación.','','introduccion-a-la-programacion-en-python-i-aprendiendo-a-programar-con-python','','','','Introducción a la programación en Python I: Aprendiendo a programar con Python','',''),(9,1,1,'This course introduces classes, instances, and inheritance. You will learn how to use classes to represent data in concise and natural ways. You\'ll also learn how to override built-in methods and how to create \"inherited\" classes that reuse functionality. You\'ll also learn about how to design classes. Finally, you will be introduced to the good programming habit of writing automated tests for their own code.','','python-classes-and-inheritance','','','','Python Classes and Inheritance','',''),(10,1,1,'This course will introduce the learner to the basics of the python programming environment, including fundamental python programming techniques such as lambdas, reading and manipulating csv files, and the numpy library. The course will introduce data manipulation and cleaning techniques using the popular python pandas data science library and introduce the abstraction of the Series and DataFrame as the central data structures for data analysis, along with tutorials on how to use functions such as groupby, merge, and pivot tables effectively. By the end of this course, students will be able to take tabular data, clean it, manipulate it, and run basic inferential statistical analyses.','','introduction-to-data-science-in-python','','','','Introduction to Data Science in Python','',''),(11,1,1,'Behind every mouse click and touch-screen tap, there is a computer program that makes things happen. This course introduces the fundamental building blocks of programming and teaches you how to write fun and useful programs using the Python language.','','learn-to-program-the-fundamentals','','','','Learn to Program: The Fundamentals','',''),(12,1,1,'本课程 (Please click https://www.coursera.org/learn/python-data-processing for English version) 主要面向非计算机专业学生，从Python基本语法开始，到Python中如何从本地和网络上进行数据获取，如何解析和表示数据，再到如何利用Python开源生态系统SciPy对数据进行基础和高级的统计分析及可视化，包括数据探索和预处理的具体方法，到最后如何设计一个简单的GUI界面来表示和处理数据，层层推进。','','python-data-processing-using-python','','','','用Python玩转数据 Data Processing Using Python','',''),(13,1,1,'You\'ve learned the basic algorithms now and are ready to step into the area of more complex problems and algorithms to solve them. Advanced algorithms build upon basic ones and use new ideas. We will start with networks flows which are used in more typical applications such as optimal matchings, finding disjoint paths and flight scheduling as well as more surprising ones like image segmentation in computer vision. We then proceed to linear programming with applications in optimizing budget allocation, portfolio optimization, finding the cheapest diet satisfying all requirements and many others. Next we discuss inherently hard problems for which no exact good solutions are known (and not likely to be found) and how to solve them in practice. We finish with a soft introduction to streaming algorithms that are heavily used in Big Data processing. Such algorithms are usually designed to be able to process huge datasets without being able even to store a dataset.','','advanced-algorithms-and-complexity','','','','Advanced Algorithms and Complexity','',''),(14,1,1,'Bem vindo ao curso de Introdução à Ciência da Computação destinado aos alunos regulares da Universidade de São Paulo e a todos os demais interessados em aprender não só a programar em Python mas também os conceitos básicos da Ciência da Computação!','','introducao-a-ciencia-da-computacao-com-python-parte-1','','','','Introdução à Ciência da Computação com Python Parte 1','',''),(15,1,1,'Computational thinking is the process of approaching a problem in a systematic manner and creating and expressing a solution such that it can be carried out by a computer.  But you don\'t need to be a computer scientist to think like a computer scientist!  In fact, we encourage students from any field of study to take this course.  Many quantitative and data-centric problems can be solved using computational thinking and an understanding of computational thinking will give you a foundation for solving problems that have real-world, social impact.','','computational-thinking-for-problem-solving','','','','Computational Thinking for Problem Solving','',''),(16,1,1,'Much of the world\'s data resides in databases. SQL (or Structured Query Language) is a powerful language which is used for communicating with and extracting data from databases. A working knowledge of databases and SQL is a must if you want to become a data scientist.','','databases-and-sql-for-data-science-with-python','','','','Databases and SQL for Data Science with Python','',''),(17,1,1,'This course will introduce the core data structures of the Python programming language. We will move past the basics of procedural programming and explore how we can use the Python built-in data structures such as lists, dictionaries, and tuples to perform increasingly complex data analysis. This course will cover Chapters 6-10 of the textbook “Python for Everybody”.  This course covers Python 3.','','python-data-structures','','','','Python Data Structures','',''),(18,1,1,'This mini-course is intended to for you to demonstrate foundational Python skills for working with data. The completion of this course involves working on a hands-on project where you will develop a simple dashboard using Python.','','python-project-for-data-science','','','','Python Project for Data Science','',''),(19,1,1,'Learn how to analyze data using Python. This course will take you from the basics of Python to exploring many different types of data. You will learn how to prepare data for analysis, perform simple statistical analysis, create meaningful data visualizations, predict future trends from data, and more!','','data-analysis-with-python','','','','Data Analysis with Python','',''),(20,1,1,'By the end of this course, you’ll be able to manipulate files and processes on your computer’s operating system. You’ll also have learned about regular expressions -- a very powerful tool for processing text files -- and you’ll get practice using the Linux command line on a virtual machine. And, this might feel like a stretch right now, but you’ll also write a program that processes a bunch of errors in an actual log file and then generates a summary file. That’s a super useful skill for IT Specialists to know.','','using-python-to-interact-with-the-operating-system','','','','Using Python to Interact with the Operating System','',''),(21,1,1,'This course will show how one can treat the Internet as a source of data.  We will scrape, parse, and read web data as well as access data using web APIs.  We will work with HTML, XML, and JSON data formats in Python.  This course will cover Chapters 11-13 of the textbook “Python for Everybody”. To succeed in this course, you should be familiar with the material covered in Chapters 1-10 of the textbook and the first two courses in this specialization.  These topics include variables and expressions, conditional execution (loops, branching, and try/except), functions, Python data structures (strings, lists, dictionaries, and tuples), and manipulating files.  This course covers Python 3.','','using-python-to-access-web-data','','','','Using Python to Access Web Data','',''),(22,1,1,'A picture is worth a thousand words. We are all familiar with this expression. It especially applies when trying to explain the insight obtained from the analysis of increasingly large datasets. Data visualization plays an essential role in the representation of both small and large-scale data.','','data-visualization-with-python','','','','Data Visualization with Python','',''),(23,1,1,'Анализ данных и машинное обучение существенно опираются на результаты из математического анализа, линейной алгебры, методов оптимизации, теории вероятностей. Без фундаментальных знаний по этим наукам невозможно понимать, как устроены методы анализа данных. Задача этого курса — сформировать такой фундамент. Мы обойдёмся без сложных формул и доказательств и сделаем упор на интерпретации и понимании смысла математических понятий и объектов.','','matematika-i-python-dlya-analiza-dannykh','','','','Математика и Python для анализа данных','',''),(24,1,1,'The practice of investment management has been transformed in recent years by computational methods. This course provides an introduction to the underlying science, with the aim of giving you a thorough understanding of that scientific basis. However, instead of merely explaining the science, we help you build on that foundation in a practical manner, with an emphasis on the hands-on implementation of those ideas in the Python programming language.','','introduction-to-portfolio-construction-and-analysis-with-python','','','','Introduction to Portfolio Construction and Analysis with Python','',''),(25,1,1,'This course will introduce students to the basics of the Structured Query Language (SQL) as well as basic database design for storing data as part of a multi-step data gathering, analysis, and processing effort.  The course will use SQLite3 as its database.  We will also build web crawlers and multi-step data gathering and visualization processes.  We will use the D3.js library to do basic data visualization.  This course will cover Chapters 14-15 of the book “Python for Everybody”. To succeed in this course, you should be familiar with the material covered in Chapters 1-13 of the textbook and the first three courses in this specialization. This course covers Python 3.','','using-databases-with-python','','','','Using Databases with Python','',''),(26,1,1,'Python – простой, гибкий и невероятно популярный язык, который используется практически во всех областях современной разработки. С его помощью можно создавать веб-приложения, писать игры, заниматься анализом данных, автоматизировать задачи системного администрирования и многое другое. “Погружение в Python” читают разработчики, применяющие Python в проектах, которыми ежедневно пользуются миллионы людей. Курс покрывает все необходимые для ежедневной работы программиста темы, а также рассказывает про многие особенности языка, которые часто опускают при его изучении.','','pogruzhenie-v-python','','','','Погружение в Python','',''),(27,1,1,'In this course, learners will be introduced to the field of statistics, including where data come from, study design, data management, and exploring and visualizing data. Learners will identify different types of data, and learn how to visualize, analyze, and interpret summaries for both univariate and multivariate data. Learners will also be introduced to the differences between probability and non-probability sampling from larger populations, the idea of how sample estimates vary, and how inferences can be made about larger populations based on probability sampling.','','understanding-and-visualizing-data-with-python','','','','Understanding and Visualizing Data with Python','',''),(28,1,1,'This mini-course is intended to apply foundational Python skills by implementing different techniques to collect and work with data. Assume the role of a Data Engineer and extract data from multiple file formats, transform it into specific datatypes, and then load it into a single source for analysis. Continue with the course and test your knowledge by implementing webscraping and extracting data with APIs all with the help of multiple hands-on labs. After completing this course you will have acquired the confidence to begin collecting large datasets from multiple sources and transform them into one primary source, or begin web scraping to gain valuable business insights all with the use of Python.','','python-project-for-data-engineering','','','','Python Project for Data Engineering','',''),(29,1,1,'This course is an introduction to computer science and programming in Python.  Upon successful completion of this course, you will be able to:','','problem-solving-python-programming-and-video-games','','','','Problem Solving, Python Programming, and Video Games','',''),(30,1,1,'This course will introduce the learner to information visualization basics, with a focus on reporting and charting using the matplotlib library. The course will start with a design and information literacy perspective, touching on what makes a good and bad visualization, and what statistical measures translate into in terms of visualizations. The second week will focus on the technology used to make visualizations in python, matplotlib, and introduce users to best practices when creating basic charts and how to realize design decisions in the framework. The third week will be a tutorial of functionality available in matplotlib, and demonstrate a variety of basic statistical charts helping learners to identify when a particular method is good for a particular problem. The course will end with a discussion of other forms of structuring and visualizing data.','','applied-plotting-charting-data-representation-in-python','','','','Applied Plotting, Charting & Data Representation in Python','',''),(31,1,1,'In the capstone, students will build a series of applications to retrieve, process and visualize data using Python.   The projects will involve all the elements of the specialization.  In the first part of the capstone, students will do some visualizations to become familiar with the technologies in use and then will pursue their own project to visualize some other data that they have or can find.  Chapters 15 and 16 from the book “Python for Everybody” will serve as the backbone for the capstone. This course covers Python 3.','','capstone-retrieving-processing-and-visualizing-data-with-python','','','','Capstone: Retrieving, Processing, and Visualizing Data with Python','',''),(32,1,1,'本系列課程從零開始，教授一般認為最適合初學者的程式語言「Python」，目標是讓大家在完成本課程之後，一方面獲得程式設計與運算思維的基本概念，一方面也能獨立寫出能解決運算問題的程式。本課程和一般程式設計課程最不同的地方，在於它是以解決商管領域的運算問題為導向，因此課程不會只含有質因數分解、紅球白球排列組合、三角不等式、萬年曆、數字排序等傳統程式設計課程的範例與作業，而是包含了生產、物流、存貨、投資、定價等問題，讓大家在學會程式設計的同時，也直接體會程式設計與資訊技術在商管領域的各種應用。','','-python-programming-for-business-computing-in-python-1','','','','用 Python 做商管程式設計（一）(Programming for Business Computing in Python (1))','',''),(33,1,1,'This class provides an introduction to the Python programming language and the iPython notebook. This is the third course in the Genomic Big Data Science Specialization from Johns Hopkins University.','','python-for-genomic-data-science','','','','Python for Genomic Data Science','',''),(34,1,1,'This course will introduce the learner to applied machine learning, focusing more on the techniques and methods than on the statistics behind these methods. The course will start with a discussion of how machine learning is different than descriptive statistics, and introduce the scikit learn toolkit through a tutorial. The issue of dimensionality of data will be discussed, and the task of clustering data, as well as evaluating those clusters, will be tackled. Supervised approaches for creating predictive models will be described, and learners will be able to apply the scikit learn predictive modelling methods while understanding process issues related to data generalizability (e.g. cross validation, overfitting). The course will end with a look at more advanced techniques, such as building ensembles, and practical limitations of predictive models. By the end of this course, students will be able to identify the difference between a supervised (classification) and unsupervised (clustering) technique, identify which technique they need to apply for a particular dataset and need, engineer features to meet that need, and write python code to carry out an analysis.','','applied-machine-learning-in-python','','','','Applied Machine Learning in Python','',''),(35,1,1,'This course introduces the dictionary data structure and user-defined functions. You’ll learn about local and global variables, optional and keyword parameter-passing, named functions and lambda expressions. You’ll also learn about Python’s sorted function and how to control the order in which it sorts by passing in another function as an input. For your final project, you’ll read in simulated social media data from a file, compute sentiment scores, and write out .csv files. It covers chapters 10-16 of the textbook “Fundamentals of Python Programming,” which is the accompanying text (optional and free) for this course.','','python-functions-files-and-dictionaries','','','','Python Functions, Files, and Dictionaries','',''),(36,1,1,'This course provides an introduction to basic data science techniques using Python.  Students are introduced to core concepts like Data Frames and joining data, and learn how to use data analysis libraries like pandas, numpy, and matplotlib.  This course provides an overview of loading, inspecting, and querying real-world data, and how to answer basic questions about that data.  Students will gain skills in data aggregation and summarization, as well as basic data visualization.','','data-analysis-using-python','','','','Data Analysis Using Python','',''),(37,1,1,'Organisations all around the world are using data to predict behaviours and extract valuable real-world insights to inform decisions. Managing and analysing big data has become an essential part of modern finance, retail, marketing, social science, development and research, medicine and government.','','foundations-of-data-science-k-means-clustering-in-python','','','','Foundations of Data Science: K-Means Clustering in Python','',''),(38,1,1,'In this course, we will explore basic principles behind using data for estimation and for assessing theories. We will analyze both categorical data and quantitative data, starting with one population techniques and expanding to handle comparisons of two populations. We will learn how to construct confidence intervals. We will also use sample data to assess whether or not a theory about the value of a parameter is consistent with the data. A major focus will be on interpreting inferential results appropriately.','','inferential-statistical-analysis-with-python','','','','Inferential Statistical Analysis with Python','',''),(39,1,1,'This course will introduce you to the wonderful world of Python programming!  We\'ll learn about the essential elements of programming and how to construct basic Python programs. We will cover expressions, variables, functions, logic, and conditionals, which are foundational concepts in computer programming. We will also teach you how to use Python modules, which enable you to benefit from the vast array of functionality that is already a part of the Python language. These concepts and skills will help you to begin to think like a computer programmer and to understand how to go about writing Python programs.','','python-programming-essentials','','','','Python Programming Essentials','',''),(40,1,1,'The practice of investment management has been transformed in recent years by computational methods. Instead of merely explaining the science, we help you build on that foundation in a practical manner, with an emphasis on the hands-on implementation of those ideas in the Python programming language. In this course, we cover the estimation, of risk and return parameters for meaningful portfolio decisions, and also introduce a variety of state-of-the-art portfolio construction techniques that have proven popular in investment management and portfolio construction due to their enhanced robustness.','','advanced-portfolio-construction-and-analysis-with-python','','','','Advanced Portfolio Construction and Analysis with Python','',''),(41,1,1,'This course teaches you to fetch and process data from services on the Internet. It covers Python list comprehensions and provides opportunities to practice extracting from and processing deeply nested data. You\'ll also learn how to use the Python requests module to interact with REST APIs and what to look for in documentation of those APIs. For the final project, you will construct a “tag recommender” for the flickr photo sharing site.','','data-collection-and-processing-with-python','','','','Data Collection and Processing with Python','',''),(42,1,1,'Курс возводит слушателя от написания простых конкретных классов к профессиональному конструированию приложения в объектно-ориентированной парадигме. Паттерны проектирования позволяют шагнуть за пределы простого использования синтаксических конструкций языка. Вы научитесь писать красиво и элегантно, будете использовать проверенные временем концепции и создавать масштабируемые программы. Использование паттернов проектирования является признаком профессионализма программиста.','','oop-i-patterny-proektirovaniya-v-python','','','','ООП и паттерны проектирования в Python','',''),(43,1,1,'This mini-course is intended to apply foundational Python skills by implementing different techniques to develop applications and AI powered solutions. Assume the role of a developer and unit test and package an application with the help of multiple hands-on labs. After completing this course you will have acquired the confidence to begin developing AI enabled applications using Python, build and run unit tests, and package the application for distribution.','','python-project-for-ai-application-development','','','','Python Project for AI & Application Development','',''),(44,1,1,'In the final course, we\'ll tie together the concepts that you’ve learned up until now. You\'ll tackle real-world scenarios in Qwiklabs that will challenge you to use multiple skills at once.','','automating-real-world-tasks-with-python','','','','Automating Real-World Tasks with Python','',''),(45,1,1,'This course will walk you through a hands-on project suitable for a portfolio. You will be introduced to third-party APIs and will be shown how to manipulate images using the Python imaging library (pillow), how to apply optical character recognition to images to recognize text (tesseract and py-tesseract), and how to identify faces in images using the popular opencv library. By the end of the course you will have worked with three different libraries available for Python 3 to create a real-world data-analysis project.','','python-project-pillow-tesseract-and-opencv','','','','Python Project: pillow, tesseract, and opencv','',''),(46,1,1,'This two-part course is designed to help students with very little or no computing background learn the basics of building simple interactive applications. Our language of choice, Python, is an easy-to learn, high-level computer language that is used in many of the computational courses offered on Coursera. To make learning Python easy, we have developed a new browser-based programming environment that makes developing interactive applications in Python simple. These applications will involve windows whose contents are graphical and respond to buttons, the keyboard and the mouse.','','an-introduction-to-interactive-programming-in-python-part-1','','','','An Introduction to Interactive Programming in Python (Part 1)','',''),(47,1,1,'This course focuses on developing Python skills for assembling business data. It will cover some of the same material from Introduction to Accounting Data Analytics and Visualization, but in a more general purpose programming environment (Jupyter Notebook for Python), rather than in Excel and the Visual Basic Editor. These concepts are taught within the context of one or more accounting data domains (e.g., financial statement data from EDGAR, stock data, loan data, point-of-sale data).','','accounting-data-analytics-with-python','','','','Accounting Data Analytics with Python','',''),(48,1,1,'Why should a designer learn to code?','','design-computing-3d-modeling-in-rhinoceros-with-python-rhinoscript','','','','Design Computing: 3D Modeling in Rhinoceros with Python/Rhinoscript','',''),(49,1,1,'Data science — одна из самых горячих областей на сегодняшний день, а Python — один из самых популярных инструментов для анализа данных. В этом курсе вы узнаете, как применять свои навыки программирования для построения предиктивных моделей, визуализации данных и работы с нейросетями.','','python-dlya-analiza-dannykh','','','','Python для анализа данных','',''),(50,1,1,'This course will enable you mastering machine-learning approaches in the area of investment management. It has been designed by two thought leaders in their field, Lionel Martellini from EDHEC-Risk Institute and John Mulvey from Princeton University. Starting from the basics, they will help you build practical skills to understand data science so you can make the best portfolio decisions.','','python-and-machine-learning-for-asset-management','','','','Python and Machine Learning for Asset Management','',''),(51,1,1,'This course will continue the introduction to Python programming that started with Python Programming Essentials.  We\'ll learn about different data representations, including strings, lists, and tuples, that form the core of all Python programs.  We will also teach you how to access files, which will allow you to store and retrieve data within your programs. These concepts and skills will help you to manipulate data and write more complex Python programs.','','python-data-representations','','','','Python Data Representations','',''),(52,1,1,'Современная жизнь немыслима без web-сервисов, ежедневно приносящих дивиденды в самых разных областях человеческой деятельности. А значит, профессия web-разработчика еще долго будет оставаться высокооплачиваемой и востребованной на рынке IT-специалистов. Существует множество решений и инструментов на разных языках программирования, упрощающих и ускоряющих web-разработку. В рамках данного курса освещается построение web-приложений на языке Python.','','sozdanie-web-servisov-na-python','','','','Создание Web-сервисов на Python','',''),(53,1,1,'This course is the first course in a series that aims to prepare you for a role working as a programmer. In this course, you will be introduced to the five main concepts in procedural programming: user input, console output, variable declaration and assignment, decision branching and iteration.  Labs will allow you to apply the material in the lectures in simple computer programs designed to re-enforce the material in the lesson.','','introduction-to-python-scripting-for-devops','','','','Introduction to Python Scripting for DevOps','',''),(54,1,1,'Este curso te dará ágil acceso a los conceptos básicos de programación utilizando el lenguaje de programación Python en su versión 3.0. Python tiene una sintaxis sencilla y compacta. Esto te permitirá aplicar rápidamente los conceptos aprendidos en los distintos aspectos de tu vida.','','introduccion-a-la-programacion-con-python','','','','Introducción a la programación con Python','',''),(55,1,1,'Сегодня язык программирования Python широко используется не только программистами. Его простота и богатый функционал позволяют людям практически любых профессий решать свои прикладные задачи проще и эффективнее с помощью программ на Python.','','python-kak-inostrannyj','','','','Python как иностранный','',''),(56,1,1,'Научитесь применять Python для анализа данных. На этом курсе вы перейдете от основ Python к изучению различных типов данных. Вы узнаете, как подготовить данные к анализу, выполнить простой статистический анализ, визуализировать данные, cпрогнозировать тенденции на основе данных и многое другое!','','analiz-dannykh-s-ispolzovaniem-python','','','','Анализ данных с использованием Python','',''),(57,1,1,'This course (The English copy of \"用Python玩转数据\" )  is mainly for non-computer majors. It starts with the basic syntax of Python, to how to acquire data in Python locally and from network, to how to present data, then to how to conduct basic and advanced statistic analysis and visualization of data, and finally to how to design a simple GUI to present and process data, advancing level by level.','','data-processing-using-python','','','','Data Processing Using Python','',''),(58,1,1,'Курс “Основы автоматизации при помощи языка Python” будет полезен всем, кто планирует заняться веб-разработкой. Вы научитесь работать с синхронным и асинхронным вебом и писать собственные консольные программы, а в результате обучения сможете создать асинхронный веб-парсер.','','osnovy-avtomatizacii-pri-pomoshhi-yazyka-python','','','','Основы автоматизации при помощи языка Python','',''),(59,1,1,'Learn how to use Amazon CodeGuru Reviewer to automatically identify issues and vulnerabilities to improve your code quality with our new digital course, Improve your Python Code using Amazon CodeGuru. This course is designed for Python developers who are interested in learning how to use CodeGuru Reviewer to save time and improve their code review process.','','improve-your-python-code-using-amazon-codeguru','','','','Improve Your Python Code Using Amazon CodeGuru','',''),(60,1,1,'Aprenda a analizar datos con Python. Este curso lo llevará desde los conceptos básicos de Python hasta la exploración de muchos tipos diferentes de datos. Aprenderá a preparar datos para el análisis, realizar análisis estadísticos simples, crear visualizaciones de datos significativas, predecir tendencias futuras a partir de datos, ¡y más!','','analisis-de-datos-con-python','','','','Análisis de datos con Python','',''),(61,1,1,'This course is the second course in a series that aims to prepare you for a role working as a programmer. In this course, you will be introduced to the four main concepts in programming: Advanced String Operations and Dates, Modeling Classes, Development of Classes and Collections.  Labs will allow the students to apply the material in the lectures in simple computer programs designed to re-enforce the material in the lesson.','','python-scripting-dates-classes-and-collections','','','','Python Scripting: Dates, Classes and Collections','',''),(62,1,1,'This course is the third course in a series that aims to prepare you for a role working as a programmer. In this course, you will be introduced to the three main concepts in programming: Files, Inheritance and external libaries.  Labs will allow the students to apply the material in the lectures in simple computer programs designed to re-enforce the material in the lesson.','','python-scripting-files-inheritance-and-databases','','','','Python Scripting: Files, Inheritance, and Databases','',''),(63,1,1,'This class provides a series of Python programming exercises intended to explore the use of numerical modeling in the Earth system and climate sciences.  The scientific background for these models is presented in a companion class, Global Warming I: The Science and Modeling of Climate Change.  This class assumes that you are new to Python programming (and this is indeed a great way to learn Python!), but that you will be able to pick up an elementary knowledge of Python syntax from another class or from on-line tutorials.','','global-warming-ii-create-your-own-models-in-python','','','','Global Warming II: Create Your Own Models in Python','',''),(64,1,1,'En este curso aprenderá cómo comenzar rápida y fácilmente con la Inteligencia Artificial utilizando IBM Watson. Comprenderá cómo funciona Watson, se familiarizará con sus casos de uso y ejemplos de clientes de la vida real, y se le presentarán varios de los servicios de inteligencia artificial de Watson de IBM que permiten a cualquiera aplicar fácilmente la inteligencia artificial y crear aplicaciones inteligentes. También trabajará con varios servicios de Watson para demostrar la IA en acción.','','python-para-data-science-y-ai','','','','Python para Data Science y AI','',''),(65,1,1,'Code and run your first python program in minutes without installing anything!','','python-basics-selection-and-iteration','','','','Python Basics: Selection and Iteration','',''),(66,1,1,'Code and run your first python program in minutes without installing anything!','','python-object-basics-functions-recursion-and-objects','','','','Python Object Basics: Functions, Recursion, and Objects','',''),(67,1,1,'This course will continue the introduction to Python programming that started with Python Programming Essentials and Python Data Representations.  We\'ll learn about reading, storing, and processing tabular data, which are common tasks.  We will also teach you about CSV files and Python\'s support for reading and writing them.  CSV files are a generic, plain text file format that allows you to exchange tabular data between different programs. These concepts and skills will help you to further extend your Python programming knowledge and allow you to process more complex data.','','python-data-analysis','','','','Python Data Analysis','',''),(68,1,1,'Code and run your first python program in minutes without installing anything!','','python-basic-structures-lists-strings-and-files','','','','Python Basic Structures: Lists, Strings, and Files','',''),(69,1,1,'This two-part course is designed to help students with very little or no computing background learn the basics of building simple interactive applications. Our language of choice, Python, is an easy-to learn, high-level computer language that is used in many of the computational courses offered on Coursera. To make learning Python easy, we have developed a new browser-based programming environment that makes developing interactive applications in Python simple. These applications will involve windows whose contents are graphical and respond to buttons, the keyboard and the mouse.','','an-introduction-to-interactive-programming-in-python-part-2','','','','An Introduction to Interactive Programming in Python (Part 2)','',''),(70,1,1,'Code and run your first python program in minutes without installing anything!','','object-oriented-python-inheritance-and-encapsulation','','','','Object-Oriented Python: Inheritance and Encapsulation','',''),(71,1,1,'Code and run your first Python script in minutes without installing anything!','','data-analysis-in-python-with-pandas-matplotlib-in-spyder','','','','Data Analysis in Python with pandas & matplotlib in Spyder','',''),(72,1,1,'Este curso te dará ágil acceso a  las estructuras de datos principales del lenguaje de programación Python en su versión 3.0.','','estructuras-de-datos-en-python','','','','Estructuras de datos en Python','',''),(73,1,1,'Este curso te dará ágil acceso a los conceptos del paradigma de programación orientado a objetos, utilizando el lenguaje de programación Python en su versión 3.0.','','programacion-orientada-a-objetos-con-python','','','','Programación Orientada a Objetos con Python','',''),(74,1,1,'Este curso te permitirá conocer qué son las bases de datos relacionales y aprender a trabajar con ellas. El lenguaje SQL que es utilizado en las bases de datos relacionales para trabajar en la definición de los datos y en la manipulación de los mismos será uno de los temas que abordarás.','','manejo-de-bases-de-datos-con-python','','','','Manejo de bases de datos con Python','',''),(75,1,1,'This course will teach you how to leverage the power of Python and artificial intelligence to create and test hypothesis. We\'ll start for the ground up, learning some basic Python for data science before diving into some of its richer applications to test our created hypothesis. We\'ll learn some of the most important libraries for exploratory data analysis (EDA) and machine learning such as Numpy, Pandas, and Sci-kit learn. After learning some of the theory (and math) behind linear regression, we\'ll go through and full pipeline of reading data, cleaning it, and applying a regression model to estimate the progression of diabetes. By the end of the course, you\'ll apply a classification model to predict the presence/absence of heart disease from a patient\'s health data.','','introduction-to-data-science-and-scikit-learn-in-python','','','','Introduction to Data Science and scikit-learn in Python','',''),(76,1,1,'The Raspberry Pi is a small, affordable single-board computer that you will use to design and develop fun and practical IoT devices while learning programming and computer hardware. In addition, you will learn how to set up up the Raspberry Pi environment, get a Linux operating system running, and write and execute some basic Python code on the Raspberry Pi. You will also learn how to use Python-based IDE (integrated development environments) for the Raspberry Pi and how to trace and debug Python code on the device. Please note that this course does not include discussion forums.','','the-raspberry-pi-platform-and-python-programming-for-the-raspberry-pi','','','','The Raspberry Pi Platform and Python Programming for the Raspberry Pi','',''),(77,1,1,'接續用 Python 做商管程式設計（一）的內容，我們將在這個課程中繼續探討Python語言中的許多核心觀念，包含函數、字串、常用的資料結構、檔案讀寫、例外處理等。最後以一個財金資料分析的例子總結。完成本次課程之後，你將會對Python有更深入的了解，並且可以利用Python實際處理一些簡單的資料分析問題。','','-python-programming-for-business-computing-in-python-2','','','','用 Python 做商管程式設計（二）(Programming for Business Computing in Python (2))','',''),(78,1,1,'SAS Viya is an in-memory distributed environment used to analyze big data quickly and efficiently. In this course, you’ll learn how to use the SAS Viya APIs to take control of SAS Cloud Analytic Services from a Jupyter Notebook using R or Python. You’ll learn to upload data into the cloud, analyze data, and create predictive models with SAS Viya using familiar open source functionality via the SWAT package -- the SAS Scripting Wrapper for Analytics Transfer. You’ll learn how to create both machine learning and deep learning models to tackle a variety of data sets and complex problems. And once SAS Viya has done the heavy lifting, you’ll be able to download data to the client and use native open source syntax to compare results and create graphics.','','using-sas-viya-rest-apis-with-python-and-r','','','','Using SAS Viya REST APIs with Python and R','',''),(79,1,1,'本系列課程從零開始，教授一般認為最適合初學者的程式語言「Python」，目標是讓大家在完成本課程之後，一方面獲得程式設計與運算思維的基本概念，一方面也能獨立寫出能解決運算問題的程式。本課程和一般程式設計課程最不同的地方，在於它是以解決商管領域的運算問題為導向，因此課程不會只含有質因數分解、紅球白球排列組合、三角不等式、萬年曆、數字排序等傳統程式設計課程的範例與作業，而是包含了生產、物流、存貨、投資、定價等問題，讓大家在學會程式設計的同時，也直接體會程式設計與資訊技術在商管領域的各種應用。','','-python-programming-for-business-computing-in-python-3','','','','用 Python 做商管程式設計（三）(Programming for Business Computing in Python (3))','',''),(80,1,1,'Этот курс для начинающих поможет на начальных этапах изучения Python для обработки и анализа данных, а также программирования в целом. Python — один из самых популярных языков программирования в мире, и сегодня очень востребованы специалисты, умеющие применять основы Python для создания бизнес-решений в различных сферах.','','python-obrabotka-i-analiz-dannykh-i-ii','','','','Python: обработка и анализ данных и ИИ','',''),(81,1,1,'This course will introduce you to fundamental concepts of a programming language called Python. After introducing you to Python concepts, the course describes how to apply those concepts to network automation using Junos PyEZ, a free Python library from Juniper Networks. This course demonstrates using Python and Junos PyEZ to automate the management of Junos OS devices.','','juniper-networks-automation-using-python-and-pyez','','','','Juniper Networks Automation Using Python and PyEZ','',''),(82,1,1,'Этот курс посвящен основам машинного обучения с использованием распространенного языка программирования — Python. \\Курс включает два основных раздела.','','mashinnoe-obuchenie-s-ispolzovaniem-python','','','','Машинное обучение с использованием Python','',''),(83,1,1,'Introduction video : https://youtu.be/TRhwIHvehR0','','practical-python-for-ai-coding-2','','','','Practical Python for AI Coding 2','',''),(84,1,1,'В настоящем курсе рассматриваются основы структурированного языка запросов (SQL) и проектирования баз данных как отдельного этапа процесса сбора, анализа и обработки данных. В качестве системы управления базой данных в курсе используется библиотека SQLite3. Мы научимся создавать поисковых роботов, а также многоэтапные процессы сбора и визуализации данных. Для простой визуализации данных мы воспользуемся библиотекой D3.js. В данном курсе рассматриваются разделы 14–15 книги «Python для всех». Для успешного прохождения курса необходимо ознакомиться с материалами разделов учебника 1–13, а также трех первых курсов по данной специализации. В этом курсе изучается язык Python 3.','','rabota-s-bazami-dannykh-v-python','','','','Работа с базами данных в Python','',''),(85,1,1,'In today\'s job market, leaders need to understand the fundamentals of data to be competitive. An essential procedure to understand business and analytics is hypothesis testing. This short course, designed by Tufts University expert faculty, will teach the fundamentals of hypothesis testing of a population mean and a population proportion, using Excel and Python for calculations. You\'ll also discover the central limit theorem, which is essential for hypothesis testing. To conclude the course, you will apply your newfound skills by creating a plan for an experiment in your own workplace that uses hypothesis testing.','','hypothesis-testing-with-python-and-excel','','','','Hypothesis Testing with Python and Excel','',''),(86,1,1,'«Лучше один раз увидеть, чем сто раз услышать». Всем нам знакомо это выражение. Оно справедливо и в случае, когда нужно объяснить выводы, полученные при анализе огромных наборов данных. Визуализация данных играет важную роль в представлении как мелких, так и крупных данных.','','vizualizaciya-dannykh-s-pomoshhyu-python','','','','Визуализация данных с помощью Python','',''),(87,1,1,'Uma imagem vale mais que mil palavras. Todos conhecemos essa expressão. Ela é válida principalmente quando se tenta explicar algum insight obtido através de análises de conjuntos de dados cada vez maiores. A visualização de dados tem um papel essencial na representação de dados pequenos e de larga escala.','','visualizacao-de-dados-com-o-python','','','','Visualização de dados com o Python','',''),(88,1,1,'В данном курсе описываются основные структуры данных языка программирования Python. Будут рассмотрены основы процедурного программирования, а также способы использования встроенных структур данных Python, например, списков, словарей и кортежей для выполнения сложного анализа данных. В данном курсе рассматриваются главы 6-10 учебника «Python для всех». В этом курсе речь идет о языке Python 3.','','struktury-dannykh-python','','','','Структуры данных Python','',''),(89,1,1,'This course demonstrates the use of Python for network analysis to detect and hijack suspicious connections.','','defensive-python','','','','Defensive Python','',''),(90,1,1,'ستقدم هذه الدورة التدريبية بُنى البيانات الأساسية للغة برمجة Python. وسوف نتجاوز أساسيات البرمجة الإجرائية ونستكشف الكيفية التي يمكننا من خلالها استخدام بُنى بيانات Python المضمَّنة، مثل القوائم والقواميس والمجموعات لإجراء تحليل معقد بشكل متزايد للبيانات. ستغطي هذه الدورة التدريبية الفصول من 6 إلى 10 من كتاب «Python للجميع» النصي. وستغطي هذه الدورة التدريبية Python 3.','','python-','','','','Python بُنى بيانات','',''),(91,1,1,'This course dives into the basics of machine learning using an approachable, and well-known programming language, Python.','','machine-learning-with-python','','','','Machine Learning with Python','',''),(92,1,1,'In modern cloud native application development, it’s oftentimes the goal to build out serverless architectures that are scalable, are highly available, and are fully managed. This means less operational overhead for you and your business, and more focusing on the applications and business specific projects that differentiate you in your marketplace. In this course, we will be covering how to build a modern, greenfield serverless backend on AWS.','','building-modern-python-applications-on-aws','','','','Building Modern Python Applications on AWS','',''),(93,1,1,'Interested in learning how to solve partial differential equations with numerical methods and how to turn them into python codes? This course provides you with a basic introduction how to apply methods like the finite-difference method, the pseudospectral method, the linear and spectral element method to the 1D (or 2D) scalar wave equation. The mathematical derivation of the computational algorithm is accompanied by python codes embedded in Jupyter notebooks. In a unique setup you can see how the mathematical equations are transformed to a computer code and the results visualized. The emphasis is on illustrating the fundamental mathematical ingredients of the various numerical methods (e.g., Taylor series, Fourier series, differentiation, function interpolation, numerical integration) and how they compare. You will be provided with strategies how to ensure your solutions are correct, for example benchmarking with analytical solutions or convergence tests. The mathematical aspects are complemented by a basic introduction to wave physics, discretization, meshes, parallel programming, computing models.','','computers-waves-simulations-a-practical-introduction-to-numerical-methods-using-python','','','','Computers, Waves, Simulations: A Practical Introduction to Numerical Methods using Python','',''),(94,1,1,'¡Te damos la bienvenida al curso de Programación en Python de la Universidad de los Andes!','','programacion-en-python','','','','Programación en Python','',''),(95,1,1,'This Statistics for Data Science course is designed to introduce you to the basic principles of statistical methods and procedures used for data analysis. After completing this course you will have practical knowledge of crucial topics in statistics including  - data gathering, summarizing data using descriptive statistics, displaying and visualizing data, examining relationships between variables, probability distributions, expected values, hypothesis testing, introduction to ANOVA (analysis of variance), regression and correlation analysis. You will take a hands-on approach to statistical analysis using Python and Jupyter Notebooks – the tools of choice for Data Scientists and Data Analysts.','','statistics-for-data-science-with-python','','','','Statistics for Data Science with Python','',''),(96,1,1,'Bem vindo ao curso de Introdução à Ciência da Computação destinado aos alunos regulares da Universidade de São Paulo!','','introducao-a-ciencia-da-computacao-com-python-parte-2','','','','Introdução à Ciência da Computação com Python Parte 2','',''),(97,1,1,'This course will introduce the learner to text mining and text manipulation basics. The course begins with an understanding of how text is handled by python, the structure of text both to the machine and to humans, and an overview of the nltk framework for manipulating text. The second week focuses on common manipulation needs, including regular expressions (searching for text), cleaning text, and preparing text for use by machine learning processes. The third week will apply basic natural language processing methods to text, and demonstrate how text classification is accomplished. The final week will explore more advanced methods for detecting the topics in documents and grouping them by similarity (topic modelling).','','applied-text-mining-in-python','','','','Applied Text Mining in Python','',''),(98,1,1,'In this course, we will expand our exploration of statistical inference techniques by focusing on the science and art of fitting statistical models to data. We will build on the concepts presented in the Statistical Inference course (Course 2) to emphasize the importance of connecting research questions to our data analysis methods. We will also focus on various modeling objectives, including making inference about relationships between variables and generating predictions for future observations.','','fitting-statistical-models-to-data-with-python','','','','Fitting Statistical Models to Data with Python','',''),(99,1,1,'В этом онлайн-курсе НИУ ВШЭ мы познакомимся с базовыми понятиями статистики, научимся аккуратно собирать данные, обрабатывать их и визуализировать. Также мы поговорим про базовые теоремы, которые используются в математической статистике: ЗБЧ и ЦПТ.','','sbor-i-analiz-dannykh-v-python','','','','Сбор и анализ данных в Python','',''),(100,1,1,'This course will introduce the learner to network analysis through tutorials using the NetworkX library. The course begins with an understanding of what network analysis is and motivations for why we might model phenomena as networks. The second week introduces the concept of connectivity and network robustness. The third week will explore ways of measuring the importance or centrality of a node in a network. The final week will explore the evolution of networks over time and cover models of network generation and the link prediction problem.','','applied-social-network-analysis-in-python','','','','Applied Social Network Analysis in Python','',''),(101,1,1,'Цель этого курса — научить всех основам программирования компьютеров с помощью Python. Мы рассмотрим основы того, как можно построить программу на основе серии простых инструкций в Python.   Курс не имеет предварительных требований и не включает никакого материала по математике, кроме самого элементарного. Любой, у кого есть умеренный опыт работы с компьютером, сумеет освоить материалы этого курса. Этот курс охватывает главы 1-5 учебника «Python for Everybody».  После завершения этого курса ученики будут готовы пройти более продвинутые курсы программирования. В этом курсе рассматривается Python 3.','','programmirovanie-dlya-vsekh-nachalo-raboty-s-python','','','','Программирование для всех (начало работы с Python)','',''),(102,1,1,'Este curso presentará a los estudiantes los conceptos básicos del lenguaje de consulta estructurado (Structured Query Language, SQL), así como el diseño básico de bases de datos para almacenar datos como parte de una iniciativa de varios pasos para recopilar, analizar y procesar datos.  El curso utilizará SQLite3 como base de datos.  También crearemos rastreadores web y procesos de visualización y recopilación de datos de varios pasos.  Utilizaremos la biblioteca D3.js para realizar la visualización básica de datos.  Este curso abarcará los capítulos de 14 y 15 del libro “Python para todos”. Para que le vaya bien en este curso, debe estar familiarizado con el material cubierto en los capítulos 1 a 13 del libro de texto y los primeros tres cursos de esta especialización. Este curso abarca Python 3.','','uso-de-bases-de-datos-con-python','','','','Uso de bases de datos con Python','',''),(103,1,1,'Este curso se orienta a enseñar los conceptos básicos de programación informática con Python. Abarca los conceptos básicos sobre cómo diseñar un programa a partir de instrucciones simples en Python.  El curso no tiene requisitos previos e incluye solo operaciones matemáticas simples. Cualquier persona con algo de experiencia en informática podrá dominar los materiales de este curso. Este curso abarcará los capítulos de 1 a 5 del libro de texto “Python para todos”.  Una vez completado este curso, el estudiante estará listo para tomar cursos de programación más avanzados. Este curso abarca Python 3.','','programacion-para-todos-introduccion-a-python','','','','Programación para todos (Introducción a Python)','',''),(104,1,1,'Il Corso fornisce i principi di programmazione, le tecniche e gli strumenti di Python, linguaggio interpretato orientato agli oggetti molto utilizzato in molteplici contesti scientifici ed aziendali.','','python-istruzioni-per-luso','','','','Python: Istruzioni per l’uso','',''),(105,1,1,'This course it the first part of the Python for Cybersecurity Specialization. Learners will get an introduction and overview of the course format and learning objectives.','','introduction-to-python-for-cybersecurity','','','','Introduction to Python for Cybersecurity','',''),(106,1,1,'This course, Machine Learning for Accounting with Python, introduces machine learning algorithms (models) and their applications in accounting problems. It covers classification, regression, clustering, text analysis, time series analysis. It also discusses model evaluation and model optimization. This course provides an entry point for students to be able to apply proper machine learning models on business related datasets with Python to solve various problems.','','machine-learning-for-accounting-with-python','','','','Machine Learning for Accounting with Python','',''),(107,1,1,'Over-utilization of market and accounting data over the last few decades has led to portfolio crowding, mediocre performance and systemic risks, incentivizing financial institutions which are looking for an edge to quickly adopt alternative data as a substitute to traditional data. This course introduces the core concepts around alternative data, the most recent research in this area, as well as practical portfolio examples and actual applications. The approach of this course is somewhat unique because while the theory covered is still a main component, practical lab sessions and examples of working with alternative datasets are also key. This course is fo you if you are aiming at carreers prospects as a data scientist in financial markets, are looking to enhance your analytics skillsets to the financial markets, or if you are interested in cutting-edge technology and research as  they apply to big data. The required background is: Python programming, Investment theory , and Statistics. This course will enable you to learn new data and research techniques applied to the financial markets while strengthening data science and python skills.','','python-and-machine-learning-for-asset-management-with-alternative-data-sets','','','','Python and Machine-Learning for Asset Management with Alternative Data Sets','',''),(108,1,1,'This if the final course in the specialization which builds upon the knowledge learned in Python Programming Essentials, Python Data Representations, and Python Data Analysis.  We will learn how to install external packages for use within Python, acquire data from sources on the Web, and then we will clean, process, analyze, and visualize that data. This course will combine the skills learned throughout the specialization to enable you to write interesting, practical, and useful programs.','','python-data-visualization','','','','Python Data Visualization','',''),(109,1,1,'Saiba como analisar dados usando Python. Este curso abrange desde o básico do Python até a exploração de diferentes tipos de dados. Você aprenderá como preparar dados para análise, executar análises estatísticas simples, criar visualizações de dados significativas, prever tendências futuras a partir de dados, e muito mais!','','analise-de-dados-com-python','','','','Análise de dados com Python','',''),(110,1,1,'Este curso mergulha nos fundamentos básicos de aprendizado de máquina usando uma linguagem de programação acessível e bem conhecida, Python.','','aprendizado-de-maquina-com-python','','','','Aprendizado de máquina com Python','',''),(111,1,1,'This course is the final course in a series that aims to prepare you for a role working as a programmer. In this course we will look at several automation concepts in DevOps with Python.  Labs will allow the students to apply the material in the lectures in simple computer programs designed to re-enforce the material in the lesson.','','devops-and-build-automation-with-python','','','','DevOps and Build Automation with Python','',''),(112,1,1,'Introduction video:  https://youtu.be/TRhwIHvehR0','','practical-python-for-ai-coding-1','','','','Practical Python for AI Coding 1','',''),(113,1,1,'Inicie seu estudo de Python para ciência de dados e de programação em geral com esta introdução ao Python feita especialmente para iniciantes. Python é uma das linguagens de programação mais populares do mundo e nunca houve tanta demanda por profissionais com a habilidade de aplicar os princípios básicos de Python para impulsionar soluções de negócios em vários setores.','','python-para-a-ciencia-de-dados-e-ia','','','','Python para a Ciência de Dados e IA','',''),(114,1,1,'Una imagen vale mas que mil palabras. Todos estamos familiarizados con esta expresión. Se aplica especialmente cuando se trata de explicar la información obtenida del análisis de conjuntos de datos cada vez más grandes. La visualización de datos juega un papel esencial en la representación de datos tanto a pequeña como a gran escala.','','visualizacion-de-datos-con-python','','','','Visualización de Datos con Python','',''),(115,1,1,'Este curso se sumerge en los conceptos básicos del aprendizaje automático mediante un lenguaje de programación accesible y conocido, Python.','','aprendizaje-automatico-con-python','','','','Aprendizaje Automático con Python','',''),(116,1,1,'Este curso de Estadística para la Ciencia de Datos está diseñado para presentarle los principios básicos de los métodos y procedimientos estadísticos utilizados para el análisis de datos. Después de completar este curso, tendrá conocimientos prácticos de temas cruciales en estadística que incluyen: recopilación de datos, resumen de datos utilizando estadísticas descriptivas, visualización de datos, examen de relaciones entre variables, distribuciones de probabilidad, valores esperados, pruebas de hipótesis, introducción a ANOVA (análisis de la varianza), análisis de regresión y correlación. Adoptará un enfoque práctico para el análisis estadístico utilizando Python y los Notebooks Jupyter, las herramientas elegidas por los científicos y analistas de datos.','','estadisticas-para-la-ciencia-de-datos-con-python','','','','Estadísticas para la Ciencia de Datos con Python','',''),(117,1,1,'Code and run your first Python program in minutes without installing anything!','','visualizing-communicating-results-in-python-with-jupyter','','','','Visualizing & Communicating Results in Python with Jupyter','',''),(118,1,1,'Este curso tem como objetivo ensinar a todos os conceitos básicos de programação de computadores usando Python. Abordamos o básico de como criar um programa a partir de uma série de instruções simples em Python.  O curso não tem pré-requisitos e evita tudo, exceto a matemática mais simples. Qualquer pessoa com experiência moderada em computadores deve ser capaz de dominar os materiais deste curso. Este curso abordará os capítulos 1 ao 5 do livro “Python para Todos”.  Assim que o aluno concluir este curso, estará preparado para fazer cursos de programação mais avançados. Este curso aborda o Python 3.','','programacao-para-todos-conceitos-basicos-de-python','','','','Programação para todos (Conceitos básicos de Python)','',''),(119,1,1,'Ce cours vise à enseigner à tous les bases de la programmation informatique en Python. Nous couvrons les bases pour construire un programme à partir d’une série d’instructions simples en Python.  Le cours ne suppose aucune condition préalable et repose sur le b.a.-ba des mathématiques. Toute personne avec une expérience informatique modérée devrait être capable de maîtriser le contenu de ce cours. Ce cours couvrira les chapitres 1 à 5 du manuel « Python pour tous ».  Lorsqu’un étudiant aura terminé ce cours, il sera en mesure de suivre des cours de programmation plus avancés. Ce cours couvre le Python 3.','','programmation-pour-tous-mise-en-route-de-python','','','','Programmation pour tous (mise en route de Python)','',''),(120,1,1,'This course covers Python for active defense.','','python-for-active-defense','','','','Python for Active Defense','',''),(121,1,1,'This course covers python for Command-and-control, Exfiltration and Impact.','','python-for-command-and-control-exfiltration-and-impact','','','','Python for Command-and-control, Exfiltration and Impact','',''),(122,1,1,'Este curso apresentará aos alunos os conceitos básicos da Linguagem de Consulta Estruturada (SQL), bem como o design básico do banco de dados para armazenar dados como parte de um esforço de coleta, análise e processamento de dados em várias etapas.  O curso usará o SQLite3 como banco de dados.  Também criaremos rastreadores da Web e processos de coleta e visualização de dados em várias etapas.  Usaremos a biblioteca D3.js para fazer a visualização básica de dados.  Este curso abordará os capítulos 14 e 15 do livro “Python para Todos”. Para ter êxito neste curso, você deve estar familiarizado com o material abordado nos capítulos 1 a 13 do livro e os três primeiros cursos desta especialização. Este curso aborda o Python 3.','','uso-de-bancos-de-dados-com-python','','','','Uso de bancos de dados com Python','',''),(123,1,1,'Welcome to advanced Python for Cybersecurity. The Reconnaissance course demonstrates the use of Python to automate the process of performing reconnaissance on target environments. We will also demonstrate how Python can be used to automate a password guessing attach to gain initial access to a target environment.','','advanced-python-reconnaissance','','','','Advanced Python - Reconnaissance','',''),(124,1,1,'En este curso, aprenderás cómo la Internet se puede convertir en una fuente de datos.  Para esto, rasparemos, analizaremos y leeremos los datos web y también accederemos datos mediante APIs web.  Trabajaremos con formatos de datos HTML, XML y JSON en Python. Este curso abarcará los capítulos 11-13 del libro de texto \"Python for Everybody\". Para tener éxito en este curso, debes estar familiarizado con el material que se incluye en los capítulos 1-10 del libro de texto y los dos primeros cursos de esta especialización.  Estos temas incluyen variables y expresiones, ejecución condicional (bucles, ramificación y try/except), funciones, estructuras de datos de Python (cadenas, listas, diccionarios y tuplas) y manipulación de archivos. Este curso abarca Python 3.','','uso-de-python-para-acceder-a-datos-web','','','','Uso de Python para Acceder a Datos Web','',''),(125,1,1,'Python per la Data Science è un corso cruciale per qualsiasi professionista che voglia analizzare grandi quantità di dati attraverso le più recenti tecniche di machine Learning e Deep learning.','','python-per-la-data-science','','','','Python per la Data Science','',''),(126,1,1,'Este curso presentará las estructuras de datos básicas del lenguaje de programación Python. Veremos los conceptos básicos de la programación de procedimientos y exploraremos cómo podemos usar las estructuras de datos integrados de Python, como listas, diccionarios y tuplas, para realizar análisis de datos cada vez más complejos. Este curso abarcará los capítulos 6 a 10 del libro de texto “Python para todos”.  Este curso cubre Python 3.','','estructuras-de-datos-de-python','','','','Estructuras de datos de Python','',''),(127,1,1,'Этот курс покажет, как можно использовать Интернет в качестве источника данных.  Мы рассмотрим скрейпинг, парсинг и чтение веб-данных, а также получение доступа к данным с помощью web API.  Мы будем работать с форматами данных HTML, XML и JSON на Python.  Этот курс будет охватывает главы 11–13 учебника «Python для всех» (Python for Everybody). Чтобы успешно пройти этот курс, вы должны быть знакомы с материалами, изложенными в главах 1–10 учебника и первых двух курсах по данной специализации.  Эти темы включают переменные и выражения, условные операторы (циклы, ветвление и исключения: try/except), функции, структуры данных Python (строки, списки, словари и кортежи), а также манипулирование файлами.  В этом курсе рассматривается Python 3.','','ispolzovanie-yazyka-python-dlya-dostupa-k-veb-dannym','','','','Использование языка Python для доступа к веб-данным','',''),(128,1,1,'Este curso apresentará as estruturas de dados centrais da linguagem de programação Python. Vamos superar os fundamentos da programação de procedimentos e explorar como podemos usar as estruturas de dados integradas do Python, como listas, dicionários e tuplas, para realizar análises de dados cada vez mais complexas. Este curso cobrirá os capítulos 6 a 10 do livro “Python para Todos”.  Este curso aborda o Python 3.','','estruturas-de-dados-python','','','','Estruturas de dados Python','',''),(129,1,1,'سيتعرف الطلاب خلال هذه الدورة على أساسيات لغة الاستعلام البنوية (SQL) وتصميم قاعدة البيانات الأساسية لتخزين البيانات كجزءٍ من جمع البيانات متعددة الخطوات وتحليلها ومعالجتها. تستخدم الدورة التدريبية SQLite3 قاعدة بيانات لها. نعمل أيضًا على إنشاء متتبعات الويب وعمليات جمع البيانات متعددة الخطوات وتصورها. نستخدم مكتبة D3.js لإجراء تصور البيانات الأساسية. تتناول هذه الدورة الفصلين 14 و15 من كتاب \"Python for Everybody\". كي تجتاز هذه الدورة، ينبغي أن تكون على دراية بالمواد المذكورة في الفصل الأول إلى الفصل 13 من الكتاب الدراسي والدورات الثلاث الأولى في هذا التخصص. تتناول هذه الدورة Python 3.','','python-','','','','Python استخدام قواعد البيانات مع','',''),(130,1,1,'In the first course of the Deep Learning Specialization, you will study the foundational concept of neural networks and deep learning.','','neural-networks-and-deep-learning','','','','Neural Networks and Deep Learning','',''),(131,1,1,'Are you interested in learning how to program (in Python) within a scientific setting?','','biology-meets-programming-bioinformatics-for-beginners','','','','Biology Meets Programming: Bioinformatics for Beginners','',''),(132,1,1,'This first course in the IBM Machine Learning Professional Certificate introduces you to Machine Learning and the content of the professional certificate. In this course you will realize the importance of good, quality data. You will learn common techniques to retrieve your data, clean it, apply feature engineering, and have it ready for preliminary analysis and hypothesis testing.','','exploratory-data-analysis-for-machine-learning','','','','Exploratory Data Analysis for Machine Learning','',''),(133,1,1,'This course gives you the background needed to gain Cybersecurity skills as part of the Cybersecurity Security Analyst Professional Certificate program.','','penetration-testing-incident-response-and-forensics','','','','Penetration Testing, Incident Response and Forensics','',''),(134,1,1,'This course covers basics of algorithm design and analysis, as well as algorithms for sorting arrays, data structures such as priority queues, hash functions, and applications such as Bloom filters.','','algorithms-for-searching-sorting-and-indexing','','','','Algorithms for Searching, Sorting, and Indexing','',''),(135,1,1,'The course will teach you how to develop deep learning models using  Pytorch. The course will start with Pytorch\'s  tensors and Automatic differentiation package. Then each section will cover different models starting off with fundamentals such as Linear Regression, and logistic/softmax regression. Followed by  Feedforward deep neural networks, the role of different activation functions, normalization and dropout layers. Then Convolutional Neural Networks and Transfer learning will be covered. Finally, several other Deep learning methods will be covered.','','deep-neural-networks-with-pytorch','','','','Deep Neural Networks with PyTorch','',''),(136,1,1,'Welcome to State Estimation and Localization for Self-Driving Cars, the second course in University of Toronto’s Self-Driving Cars Specialization. We recommend you take the first course in the Specialization prior to taking this course.','','state-estimation-and-localization-for-self-driving-cars','','','','State Estimation and Localization for Self-Driving Cars','',''),(137,1,1,'This course will get you up and running with MongoDB quickly, and teach you how to leverage its power for data analytics.','','introduction-to-mongodb','','','','Introduction to MongoDB','',''),(138,1,1,'Do you have data and wonder what it can tell you?  Do you need a deeper understanding of the core ways in which machine learning can improve your business?  Do you want to be able to converse with specialists about anything from regression and classification to deep learning and recommender systems?','','machine-learning-foundations-a-case-study-approach','','','','Machine Learning Foundations: A Case Study Approach','',''),(139,1,1,'This course gives you an introduction to modeling methods and simulation tools for a wide range of natural phenomena. The different methodologies that will be presented here can be applied to very wide range of topics such as fluid motion, stellar dynamics, population evolution, ... This course does not intend to go deeply into any numerical method or process and does not provide any recipe for the resolution of a particular problem. It is rather a basic guideline towards different methodologies that can be applied to solve any kind of problem and help you pick the one best suited for you.','','simulation-and-modeling-of-natural-processes','','','','Simulation and modeling of natural processes','',''),(140,1,1,'Do you want to know how robots work?  Are you interested in robotics as a career?  Are you willing to invest the effort to learn fundamental mathematical modeling techniques that are used in all subfields of robotics?','','modern-robotics-course-1-foundations-of-robot-motion','','','','Modern Robotics, Course 1:  Foundations of Robot Motion','',''),(141,1,1,'The goal of this course is to give learners basic understanding of modern neural networks and their applications in computer vision and natural language understanding. The course starts with a recap of linear models and discussion of stochastic optimization methods that are crucial for training deep neural networks. Learners will study all popular building blocks of neural networks including fully connected layers, convolutional and recurrent layers.','','introduction-to-deep-learning','','','','Introduction to Deep Learning','',''),(142,1,1,'Welcome to the course “Seismic tomography: Look inside the Earth”.','','seismic-tomography-look-inside-the-earth','','','','Seismic tomography: look inside the Earth','',''),(143,1,1,'This course introduces the concepts of Artificial Intelligence and Machine learning. We\'ll discuss machine learning types and tasks, and machine learning algorithms. You\'ll  explore Python as a popular programming language for machine learning solutions, including using some scientific ecosystem packages which will help you implement machine learning.','','developing-ai-applications-on-azure','','','','Developing AI Applications on Azure','',''),(144,1,1,'In this course the learner will be shown how to generate forecasts of game results in professional sports using Python. The main emphasis of the course is on teaching the method of logistic regression as a way of modeling game results, using data on team expenditures. The learner is taken through the process of modeling past results, and then using the model to forecast the outcome games not yet played. The course will show the learner how to evaluate the reliability of a model using data on betting odds. The analysis is applied first to the English Premier League, then the NBA and NHL. The course also provides an overview of the relationship between data analytics and gambling, its history and the social issues that arise in relation to sports betting, including the personal risks.','','prediction-models-with-sports-data','','','','Prediction Models with Sports Data','',''),(145,1,1,'In this course, you will be learning from ML Engineers and Trainers who work with the state-of-the-art development of ML pipelines here at Google Cloud.  The first few modules will cover about TensorFlow Extended (or TFX), which is Google’s production machine learning platform based on TensorFlow for management of ML pipelines and metadata. You will learn about pipeline components and pipeline orchestration with TFX. You will also learn how you can automate your pipeline through continuous integration and continuous deployment, and how to manage ML metadata.','','ml-pipelines-on-google-cloud','','','','ML Pipelines on Google Cloud','',''),(146,1,1,'This course will teach you how to leverage the power of Python to understand complicated supply chain datasets. Even if you are not familiar with supply chain fundamentals, the rich data sets that we will use as a canvas will help orient you with several Pythonic tools and best practices for exploratory data analysis (EDA). As such, though all datasets are geared towards supply chain minded professionals, the lessons are easily generalizable to other use cases.','','fundamentals-of-machine-learning-for-supply-chain','','','','Fundamentals of Machine Learning for Supply Chain','',''),(147,1,1,'In Object-Oriented Concepts, we will introduce the core concepts behind modern, object-oriented, programming.  We will discuss objects, classes, messaging, inheritance, polymorphism, and more.  As with Fundamentals of Programming, we will illustrate the concepts using the Python language, but they will be portable to other object-oriented programming languages.','','object-oriented-programming-concepts','','','','Object-Oriented Programming Concepts','',''),(148,1,1,'We’ll implement (in Python) together efficient programs for a problem needed by delivery companies all over the world millions times per day — the travelling salesman problem. The goal in this problem is to visit all the given places as quickly as possible. How to find an optimal solution to this problem quickly? We still don’t have provably efficient algorithms for this difficult computational problem and this is the essence of the P versus NP problem, the most important open question in Computer Science. Still, we’ll implement several solutions for real world instances of the travelling salesman problem. While designing these solutions, we will rely heavily on the material learned in the courses of the specialization: proof techniques, combinatorics, probability, graph theory. We’ll see several examples of using discrete mathematics ideas to get more and more efficient solutions.','','delivery-problem','','','','Delivery Problem','',''),(149,1,1,'In this course we will learn about Recommender Systems (which we will study for the Capstone project), and also look at deployment issues for data products. By the end of this course, you should be able to implement a working recommender system (e.g. to predict ratings, or generate lists of related products), and you should understand the tools and techniques required to deploy such a working system on real-world, large-scale datasets.','','deploying-machine-learning-models','','','','Deploying Machine Learning Models','',''),(150,1,1,'|The basis for education in the last millennium was “reading, writing, and arithmetic','','computer-science-programming-with-a-purpose','','','','Computer Science: Programming with a Purpose','',''),(151,1,1,'This course can be taken for academic credit as part of CU Boulder’s Master of Science in Data Science (MS-DS) degree offered on the Coursera platform. The MS-DS is an interdisciplinary degree that brings together faculty from CU Boulder’s departments of Applied Mathematics, Computer Science, Information Science, and others. With performance-based admissions and no application process, the MS-DS is ideal for individuals with a broad range of undergraduate education and/or professional experience in computer science, information science, mathematics, and statistics. Learn more about the MS-DS program at https://www.coursera.org/degrees/master-of-science-data-science-boulder.','','deep-learning-applications-for-computer-vision','','','','Deep Learning Applications for Computer Vision','',''),(152,1,1,'Machine Learning is one of the most innovative fields in technology, and the Google Cloud Platform has been instrumental in furthering its development. With a host of APIs, Google Cloud has a tool for just about any machine learning job. In this advanced-level Google Cloud Labs Series, you will get hands-on practice with machine learning at scale and how to employ the advanced machine learning infrastructure available on Google Cloud.','','advanced-machine-learning-machine-learning-infrastructure','','','','Advanced Machine Learning: Machine Learning Infrastructure','',''),(153,1,1,'This Azure training course is designed to equip students with the knowledge need to process, store and analyze data for making informed business decisions. Through this Azure course, the student will understand what big data is along with the importance of big data analytics, which will improve the students mathematical and programming skills. Students will learn the most effective method of using essential analytical tools such as Python, R, and Apache Spark.','','data-processing-with-azure','','','','Data Processing with Azure','',''),(154,1,1,'This course will take you through the various parts of analytical dashboarding: from best practices for designing a dashboard, creating a unified analytical environment, to deploying and publishing visualizations. We will briefly discuss the advanced visualization techniques and you will develop an information layout of the biggest gainers and losers in the financial markets and compare those movements to the economic data as your capstone project.','','dashboarding-and-deployment','','','','Dashboarding and Deployment','',''),(155,1,1,'Machine learning is the science of getting computers to act without being explicitly programmed. In the past decade, machine learning has given us self-driving cars, practical speech recognition, effective web search, and a vastly improved understanding of the human genome. Machine learning is so pervasive today that you probably use it dozens of times a day without knowing it. Many researchers also think it is the best way to make progress towards human-level AI. In this class, you will learn about the most effective machine learning techniques, and gain practice implementing them and getting them to work for yourself. More importantly, you\'ll learn about not only the theoretical underpinnings of learning, but also gain the practical know-how needed to quickly and powerfully apply these techniques to new problems. Finally, you\'ll learn about some of Silicon Valley\'s best practices in innovation as it pertains to machine learning and AI.','','machine-learning','','','','Machine Learning','',''),(156,1,1,'Do you realize that the only functionality of a web application that the user directly interacts with is through the web page? Implement it poorly and, to the user, the server-side becomes irrelevant! Today’s user expects a lot out of the web page: it has to load fast, expose the desired service, and be comfortable to view on all devices: from a desktop computers to tablets and mobile phones.','','html-css-and-javascript-for-web-developers','','','','HTML, CSS, and Javascript for Web Developers','',''),(157,1,1,'This course will provide you a foundational understanding of machine learning models (logistic regression, multilayer perceptrons, convolutional neural networks, natural language processing, etc.) as well as demonstrate how these models can solve complex problems in a variety of industries, from medical diagnostics to image recognition to text prediction. In addition, we have designed practice exercises that will give you hands-on experience implementing these data science models on data sets. These practice exercises will teach you how to implement machine learning algorithms with PyTorch, open source libraries used by leading tech companies in the machine learning field (e.g., Google, NVIDIA, CocaCola, eBay, Snapchat, Uber and many more).','','introduction-to-machine-learning','','','','Introduction to Machine Learning','',''),(158,1,1,'This course is designed to start you on a path toward future studies in web development and design, no matter how little experience or technical knowledge you currently have. The web is a very big place, and if you are the typical internet user, you probably visit several websites every day, whether for business, entertainment or education. But have you ever wondered how these websites actually work? How are they built? How do browsers, computers, and mobile devices interact with the web? What skills are necessary to build a website? With almost 1 billion websites now on the internet, the answers to these questions could be your first step toward a better understanding of the internet and developing a new set of internet skills.','','introduction-to-web-development','','','','Introduction to Web Development','',''),(159,1,1,'Machine Learning, often called Artificial Intelligence or AI, is one of the most exciting areas of technology at the moment. We see daily news stories that herald new breakthroughs in facial recognition technology, self driving cars or computers that can have a conversation just like a real person. Machine Learning technology is set to revolutionise almost any area of human life and work, and so will affect all our lives, and so you are likely to want to find out more about it. Machine Learning has a reputation for being one of the most complex areas of computer science, requiring advanced mathematics and engineering skills to understand it. While it is true that working as a Machine Learning engineer does involve a lot of mathematics and programming, we believe that anyone can understand the basic concepts of Machine Learning, and given the importance of this technology, everyone should. The big AI breakthroughs sound like science fiction, but they come down to a simple idea: the use of data to train statistical algorithms. In this course you will learn to understand the basic idea of machine learning, even if you don\'t have any background in math or programming. Not only that, you will get hands on and use user friendly tools developed at Goldsmiths, University of London to actually do a machine learning project: training a computer to recognise images. This course is for a lot of different people. It could be a good first step into a technical career in Machine Learning, after all it is always better to start with the high level concepts before the technical details, but it is also great if your role is non-technical. You might be a manager or other non-technical role in a company that is considering using Machine Learning. You really need to understand this technology, and this course is a great place to get that understanding. Or you might just be following the news reports about AI and interested in finding out more about the hottest new technology of the moment. Whoever you are, we are looking forward to guiding you through you first machine learning project.','','machine-learning-for-all','','','','Machine Learning for All','',''),(160,1,1,'In the first course of the Practical Data Science Specialization, you will learn foundational concepts for exploratory data analysis (EDA), automated machine learning (AutoML), and text classification algorithms. With Amazon SageMaker Clarify and Amazon SageMaker Data Wrangler, you will analyze a dataset for statistical bias, transform the dataset into machine-readable features, and select the most important features to train a multi-class text classifier. You will then perform automated machine learning (AutoML) to automatically train, tune, and deploy the best text-classification algorithm for the given dataset using Amazon SageMaker Autopilot. Next, you will work with Amazon SageMaker BlazingText, a highly optimized and scalable implementation of the popular FastText algorithm, to train a text classifier with very little code.','','analyze-datasets-and-train-ml-models-using-automl','','','','Analyze Datasets and Train ML Models using AutoML','',''),(161,1,1,'Computer Vision is one of the most exciting fields in Machine Learning and AI. It has applications in many industries, such as self-driving cars, robotics, augmented reality, and much more. In this beginner-friendly course, you will understand computer vision and learn about its various applications across many industries.','','introduction-to-computer-vision-and-image-processing','','','','Introduction to Computer Vision and Image Processing','',''),(162,1,1,'This capstone project course will give you a taste of what data scientists go through in real life when working with real datasets. You will assume the role of a Data Scientist working for a startup intending to compete with SpaceX, and in the process follow the Data Science methodology involving data collection, data wrangling, exploratory data analysis, data visualization, model development, model evaluation, and reporting your results to stakeholders.','','applied-data-science-capstone','','','','Applied Data Science Capstone','',''),(163,1,1,'In a professional environment, we’re often faced with the need to respond appropriately according to what the situation calls for, whether it be related to situations in daily life or the workplace.','','english-for-common-interactions-in-the-workplace-basic-level','','','','English for Common Interactions in the Workplace: Basic Level','',''),(164,1,1,'During the course, you’ll learn everything needed to participate in real competitions — that’s the main goal. Along the way you’ll also gain useful skills for which competitive programmers are so highly valued by employers: ability to write efficient, reliable, and compact code, manage your time well when it’s limited, apply basic algorithmic ideas to real problems, etc.','','competitive-programmer-s-core-skills','','','','Competitive Programmer\'s Core Skills','',''),(165,1,1,'Welcome to the first course in the Building Cloud Computing Solutions at Scale Specialization! In this course, you will learn how to build foundational Cloud computing infrastructure, including websites involving serverless technology and virtual machines. You will also learn how to apply Agile software development techniques to projects which will be useful in building portfolio projects and global-scale Cloud infrastructures.','','cloud-computing-foundations','','','','Cloud Computing Foundations','',''),(166,1,1,'In this course, you will learn how Django communicates with a database through model objects. You will explore Object-Relational Mapping (ORM) for database access and how Django models implement this pattern.  We will review the Object-Oriented (OO) pattern in Python.  You will learn basic Structured Query Language (SQL) and database modeling, including one-to-many and many-to-many relationships and how they work in both the SQL and Django models. You will learn how to use the Django console and scripts to work with your application objects interactively.','','building-web-applications-in-django','','','','Building Web Applications in Django','',''),(167,1,1,'Computer vision (CV) is a fascinating field of study that attempts to automate the process of assigning meaning to digital images or videos. In other words, we are helping computers see and understand the world around us! A number of machine learning (ML) algorithms and techniques can be used to accomplish CV tasks, and as ML becomes faster and more efficient, we can deploy these techniques to embedded systems.','','computer-vision-with-embedded-machine-learning','','','','Computer Vision with Embedded Machine Learning','',''),(168,1,1,'Accounting has always been about analytical thinking. From the earliest days of the profession, Luca Pacioli emphasized the importance of math and order for analyzing business transactions. The skillset that accountants have needed to perform math and to keep order has evolved from pencil and paper, to typewriters and calculators, then to spreadsheets and accounting software. A new skillset that is becoming more important for nearly every aspect of business is that of big data analytics: analyzing large amounts of data to find actionable insights. This course is designed to help accounting students develop an analytical mindset and prepare them to use data analytic programming languages like Python and R.','','introduction-to-accounting-data-analytics-and-visualization','','','','Introduction to Accounting Data Analytics and Visualization','',''),(169,1,1,'Welcome to Visual Perception for Self-Driving Cars, the third course in University of Toronto’s Self-Driving Cars Specialization.','','visual-perception-for-self-driving-cars','','','','Visual Perception for Self-Driving Cars','',''),(170,1,1,'What you’ll achieve:','','build-your-first-android-app-project-centered-course','','','','Build Your First Android App (Project-Centered Course)','',''),(171,1,1,'A good algorithm usually comes together with a set of good data structures that allow the algorithm to manipulate the data efficiently. In this course, we consider the common data structures that are used in various computational problems. You will learn how these data structures are implemented in different programming languages and will practice implementing them in our programming assignments. This will help you to understand what is going on inside a particular built-in implementation of a data structure and what to expect from it. You will also learn typical use cases for these data structures.','','data-structures','','','','Data Structures','',''),(172,1,1,'This course aims at providing an introductory and broad overview of the field of ML with the focus on applications on Finance. Supervised Machine Learning methods are used in the capstone project to predict bank closures. Simultaneously, while this course can be taken as a separate course, it serves as a preview of topics that are covered in more details in subsequent modules of the specialization Machine Learning and Reinforcement Learning in Finance.','','guided-tour-of-machine-learning-in-finance','','','','Guided Tour of Machine Learning in Finance','',''),(173,1,1,'This course introduces you to one of the main types of modeling families of supervised Machine Learning: Classification. You will learn how to train predictive models to classify categorical outcomes and how to use error metrics to compare across different models. The hands-on section of this course focuses on using best practices for classification, including train and test splits, and handling data sets with unbalanced classes.','','supervised-machine-learning-classification','','','','Supervised Machine Learning: Classification','',''),(174,1,1,'This course provides the foundation for developing advanced trading strategies using machine learning techniques. In this course, you’ll review the key components that are common to every trading strategy, no matter how complex. You’ll be introduced to multiple trading strategies including quantitative trading, pairs trading, and momentum trading. By the end of the course, you will be able to design basic quantitative trading strategies, build machine learning models using Keras and TensorFlow, build a pair trading strategy prediction model and back test it, and build a momentum-based trading model and back test it.','','using-machine-learning-in-trading-and-finance','','','','Using Machine Learning in Trading and Finance','',''),(175,1,1,'&gt;&gt;&gt; By enrolling in this course you agree to the End User License Agreement as set out in the FAQ.  Once enrolled you can access the license in the Resources area &lt;&lt;','','advanced-machine-learning-and-signal-processing','','','','Advanced Machine Learning and Signal Processing','',''),(176,1,1,'Manipulating big data distributed over a cluster using functional concepts is rampant in industry, and is arguably one of the first widespread industrial uses of functional ideas. This is evidenced by the popularity of MapReduce and Hadoop, and most recently Apache Spark, a fast, in-memory distributed collections framework written in Scala. In this course, we\'ll see how the data parallel paradigm can be extended to the distributed case, using Spark throughout. We\'ll cover Spark\'s programming model in detail, being careful to understand how and when it differs from familiar programming models, like shared-memory parallel collections or sequential Scala collections. Through hands-on examples in Spark and Scala, we\'ll learn when important issues related to distribution like latency and network communication should be considered and how they can be addressed effectively for improved performance.','','big-data-analysis-with-scala-and-spark','','','','Big Data Analysis with Scala and Spark','',''),(177,1,1,'Огромное количество данных в мире хранится в базах данных. Для управления данными, в том числе для извлечения данных, чаще всего используют язык структурированных запросов SQL (Structured Query Language). Если вы хотите стать аналитиком данных, то вам необходимы практические знания в области баз данных и SQL.','','bazy-dannykh-i-sql-v-obrabotke-i-analize-dannykh','','','','Базы данных и SQL в обработке и анализе данных','',''),(178,1,1,'This course introduces you to additional topics in Machine Learning that complement essential tasks, including forecasting and analyzing censored data. You will learn how to find analyze data with a time component and censored data that needs outcome inference. You will learn a few techniques for Time Series Analysis and Survival Analysis. The hands-on section of this course focuses on using best practices and verifying assumptions derived from Statistical Learning.','','specialized-models-time-series-and-survival-analysis','','','','Specialized Models: Time Series and Survival Analysis','',''),(179,1,1,'This course will empower you with the skills to scale data science and machine learning (ML) tasks on Big Data sets using Apache Spark. Most real world machine learning work involves very large data sets that go beyond the CPU, memory and storage limitations of a single computer.','','scalable-machine-learning-on-big-data-using-apache-spark','','','','Scalable Machine Learning on Big Data using Apache Spark','',''),(180,1,1,'If you want to break into competitive data science, then this course is for you! Participating in predictive modelling competitions can help you gain practical experience, improve and harness your data modelling skills in various domains such as credit, insurance, marketing, natural language processing, sales’ forecasting and computer vision to name a few. At the same time you get to do it in a competitive context against thousands of participants where each one tries to build the most predictive algorithm. Pushing each other to the limit can result in better performance and smaller prediction errors. Being able to achieve high ranks consistently can help you accelerate your career in data science.','','how-to-win-a-data-science-competition-learn-from-top-kagglers','','','','How to Win a Data Science Competition: Learn from Top Kagglers','',''),(181,1,1,'This course introduces you to one of the main types of Machine Learning: Unsupervised Learning. You will learn how to find insights from data sets that do not have a target or labeled variable. You will learn several clustering and dimension reduction algorithms for unsupervised learning as well as how to select the algorithm that best suits your data. The hands-on section of this course focuses on using best practices for unsupervised learning.','','unsupervised-machine-learning','','','','Unsupervised Machine Learning','',''),(182,1,1,'The course aims at helping students to be able to solve practical ML-amenable problems that they may encounter in real life that include: (1) understanding where the problem one faces lands on a general landscape of available ML methods, (2) understanding which particular ML approach(es) would be most appropriate for resolving the problem, and (3) ability to successfully implement a solution, and assess its performance.','','fundamentals-of-machine-learning-in-finance','','','','Fundamentals of Machine Learning in Finance','',''),(183,1,1,'Case Studies: Finding Similar Documents','','machine-learning-clustering-retrieval','','','','Machine Learning: Clustering & Retrieval','',''),(184,1,1,'Do you want to know how robots work?  Are you interested in robotics as a career?  Are you willing to invest the effort to learn fundamental mathematical modeling techniques that are used in all subfields of robotics?','','modern-robotics-course-2-robot-kinematics','','','','Modern Robotics, Course 2:  Robot Kinematics','',''),(185,1,1,'This course is an introduction to sequence models and their applications, including an overview of sequence model architectures and how to handle inputs of variable length.','','sequence-models-for-time-series-and-natural-language-processing','','','','Sequence Models for Time Series and Natural Language Processing','',''),(186,1,1,'Do you want to know how robots work?  Are you interested in robotics as a career?  Are you willing to invest the effort to learn fundamental mathematical modeling techniques that are used in all subfields of robotics?','','modern-robotics-course-4-robot-motion-planning-and-control','','','','Modern Robotics, Course 4:  Robot Motion Planning and Control','',''),(187,1,1,'Do you want to know how robots work?  Are you interested in robotics as a career?  Are you willing to invest the effort to learn fundamental mathematical modeling techniques that are used in all subfields of robotics?','','modern-robotics-course-3-robot-dynamics','','','','Modern Robotics, Course 3:  Robot Dynamics','',''),(188,1,1,'This course is all about data and how it is critical to the success of your applied machine learning model. Completing this course will give learners the skills to:','','data-for-machine-learning','','','','Data for Machine Learning','',''),(189,1,1,'Do you want to know how robots work?  Are you interested in robotics as a career?  Are you willing to invest the effort to learn fundamental mathematical modeling techniques that are used in all subfields of robotics?','','modern-robotics-course-5-robot-manipulation-and-wheeled-mobile-robots','','','','Modern Robotics, Course 5:  Robot Manipulation and Wheeled Mobile Robots','',''),(190,1,1,'This is the fourth course in the IBM AI Enterprise Workflow Certification specialization.    You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones. ','','ai-workflow-machine-learning-visual-recognition-and-nlp','','','','AI Workflow: Machine Learning, Visual Recognition and NLP','',''),(191,1,1,'Exploration of Data Science requires certain background in probability and statistics. This course introduces you to the necessary sections of probability theory and statistics, guiding you from the very basics all way up to the level required for jump starting your ascent in Data Science.','','probability-theory-statistics-and-exploratory-data-analysis','','','','Probability Theory, Statistics and Exploratory Data Analysis','',''),(192,1,1,'Experienced Computer Scientists analyze and solve computational problems at a level of abstraction that is beyond that of any particular programming language.  This two-part course builds on the principles that you learned in our Principles of Computing course and is designed to train students in the mathematical concepts and process of \"Algorithmic Thinking\", allowing them to build simpler, more efficient solutions to real-world computational problems.','','algorithmic-thinking-part-1','','','','Algorithmic Thinking (Part 1)','',''),(193,1,1,'In this course, the instructor will discuss the fundamental analysis of investment using R programming. The course will cover investment analysis topics, but at the same time, make you practice it using R programming. This course\'s focus is to train you to do the elemental analysis for investment management that you might need to do in your job every day.','','the-fundamental-of-data-driven-investment','','','','The Fundamental of Data-Driven Investment','',''),(194,1,1,'What are some of the most popular data science tools, how do you use them, and what are their features? In this course, you\'ll learn about Jupyter Notebooks, JupyterLab, RStudio IDE, Git, GitHub, and Watson Studio. You will learn about what each tool is used for, what programming languages they can execute, their features and limitations. With the tools hosted in the cloud on Skills Network Labs, you will be able to test each tool and follow instructions to run simple code in Python, R or Scala. To end the course, you will create a final project with a Jupyter Notebook on IBM Watson Studio and demonstrate your proficiency preparing a notebook, writing Markdown, and sharing your work with your peers.','','tools-for-data-science','','','','Tools for Data Science','',''),(195,1,1,'In the second course of the Deep Learning Specialization, you will open the deep learning black box to understand the processes that drive performance and generate good results systematically.','','improving-deep-neural-networks-hyperparameter-tuning-regularization-and-optimization','','','','Improving Deep Neural Networks: Hyperparameter Tuning, Regularization and Optimization','',''),(196,1,1,'If you are a software developer who wants to build scalable AI-powered algorithms, you need to understand how to use the tools to build them. This course is part of the upcoming Machine Learning in Tensorflow Specialization and will teach you best practices for using TensorFlow, a popular open-source framework for machine learning.','','introduction-to-tensorflow-for-artificial-intelligence-machine-learning-and-deep-learning','','','','Introduction to TensorFlow for Artificial Intelligence, Machine Learning, and Deep Learning','',''),(197,1,1,'In Course 1 of the Natural Language Processing Specialization, you will:','','natural-language-processing-with-classification-and-vector-spaces','','','','Natural Language Processing with Classification and Vector Spaces','',''),(198,1,1,'In the fourth course of the Deep Learning Specialization, you will understand how computer vision has evolved and become familiar with its exciting applications such as autonomous driving, face recognition, reading radiology images, and more.','','convolutional-neural-networks','','','','Convolutional Neural Networks','',''),(199,1,1,'If you are a software developer who wants to build scalable AI-powered algorithms, you need to understand how to use the tools to build them. This course is part of the upcoming Machine Learning in Tensorflow Specialization and will teach you best practices for using TensorFlow, a popular open-source framework for machine learning.','','convolutional-neural-networks-in-tensorflow','','','','Convolutional Neural Networks in TensorFlow','',''),(200,1,1,'Service level indicators (SLIs) and service level objectives (SLOs) are fundamental tools for measuring and managing reliability. In this course, students learn approaches for devising appropriate SLIs and SLOs and managing reliability through the use of an error budget.','','site-reliability-engineering-measuring-and-managing-reliability','','','','Site Reliability Engineering: Measuring and Managing Reliability','',''),(201,1,1,'In this course, you will:','','build-basic-generative-adversarial-networks-gans','','','','Build Basic Generative Adversarial Networks (GANs)','',''),(202,1,1,'If you are a software developer who wants to build scalable AI-powered algorithms, you need to understand how to use the tools to build them. This Specialization will teach you best practices for using TensorFlow, a popular open-source framework for machine learning.','','natural-language-processing-in-tensorflow','','','','Natural Language Processing in TensorFlow','',''),(203,1,1,'If you are a software developer who wants to build scalable AI-powered algorithms, you need to understand how to use the tools to build them. This Specialization will teach you best practices for using TensorFlow, a popular open-source framework for machine learning.','','sequences-time-series-and-prediction','','','','Sequences, Time Series and Prediction','',''),(204,1,1,'In Course 2 of the Natural Language Processing Specialization, you will:','','natural-language-processing-with-probabilistic-models','','','','Natural Language Processing with Probabilistic Models','',''),(205,1,1,'In this course on Linear Algebra we look at what linear algebra is and how it relates to vectors and matrices. Then we look through what vectors and matrices are and how to work with them, including the knotty problem of eigenvalues and eigenvectors, and how to use these to solve problems. Finally  we look at how to use these to do fun things with datasets - like how to rotate images of faces and how to extract eigenvectors to look at how the Pagerank algorithm works.','','mathematics-for-machine-learning-linear-algebra','','','','Mathematics for Machine Learning: Linear Algebra','',''),(206,1,1,'In Course 3 of the Natural Language Processing Specialization, you will:','','natural-language-processing-with-sequence-models','','','','Natural Language Processing with Sequence Models','',''),(207,1,1,'This course provides an introduction to basic computational methods for understanding what nervous systems do and for determining how they function. We will explore the computational principles governing various aspects of vision, sensory-motor control, learning, and memory. Specific topics that will be covered include representation of information by spiking neurons, processing of information in neural networks, and algorithms for adaptation and learning. We will make use of Matlab/Octave/Python demonstrations and exercises to gain a deeper understanding of concepts and methods introduced in the course. The course is primarily aimed at third- or fourth-year undergraduates and beginning graduate students, as well as professionals and distance learners interested in learning how the brain processes information.','','computational-neuroscience','','','','Computational Neuroscience','',''),(208,1,1,'In this course, you will:','','custom-models-layers-and-loss-functions-with-tensorflow','','','','Custom Models, Layers, and Loss Functions with TensorFlow','',''),(209,1,1,'Mathematical thinking is crucial in all areas of computer science: algorithms, bioinformatics, computer graphics, data science, machine learning, etc. In this course, we will learn the most important tools used in discrete mathematics: induction, recursion, logic, invariants, examples, optimality. We will use these tools to answer typical programming questions like: How can we be certain a solution exists? Am I sure my program computes the optimal answer? Do each of these objects meet the given requirements?','','mathematical-thinking-in-computer-science','','','','Mathematical Thinking in Computer Science','',''),(210,1,1,'In this course, you will:','','advanced-computer-vision-with-tensorflow','','','','Advanced Computer Vision with TensorFlow','',''),(211,1,1,'|The course covers basic algorithmic techniques and ideas for computational problems arising frequently in practical applications: sorting and searching, divide and conquer, greedy algorithms, dynamic programming. We will learn a lot of theory: how to sort data and how it helps for searching','','algorithmic-toolbox','','','','Algorithmic Toolbox','',''),(212,1,1,'In this course, you will:','','custom-and-distributed-training-with-tensorflow','','','','Custom and Distributed Training with TensorFlow','',''),(213,1,1,'Looking to start a career in Deep Learning? Look no further. This course will introduce you to the field of deep learning and help you answer many questions that people are asking nowadays, like what is deep learning, and how do deep learning models compare to artificial neural networks? You will learn about the different deep learning models and build your first deep learning model using the Keras library.','','introduction-to-deep-learning-neural-networks-with-keras','','','','Introduction to Deep Learning & Neural Networks with Keras','',''),(214,1,1,'Bernard Marr defines Big Data as the digital trace that we are generating in this digital era. In this course, you will learn about the characteristics of Big Data and its application in Big Data Analytics. You will gain an understanding about the features, benefits, limitations, and applications of some of the Big Data processing tools. You’ll explore how Hadoop and Hive help leverage the benefits of Big Data while overcoming some of the challenges it poses.','','introduction-to-big-data-with-spark-and-hadoop','','','','Introduction to Big Data with Spark and Hadoop','',''),(215,1,1,'This course provides an introduction to using Python to analyze team performance in sports. Learners will discover a variety of techniques that can be used to represent sports data and how to extract narratives based on these analytical techniques. The main focus of the introduction will be on the use of regression analysis to analyze team and player performance data, using examples drawn from the National Football League (NFL), the National Basketball Association (NBA), the National Hockey League (NHL), the English Premier LEague (EPL, soccer) and the Indian Premier League (IPL, cricket).','','foundations-of-sports-analytics-data-representation-and-models-in-sports','','','','Foundations of Sports Analytics: Data, Representation, and Models in Sports','',''),(216,1,1,'After taking this course, you will be able to describe two different approaches to converting raw data into analytics-ready data. One approach is the Extract, Transform, Load (ETL) process. The other contrasting approach is the Extract, Load, and Transform (ELT) process. ETL processes apply to data warehouses and data marts. ELT processes apply to data lakes, where the data is transformed on demand by the requesting/calling application.','','etl-and-data-pipelines-with-shell-airflow-and-kafka','','','','ETL and Data Pipelines with Shell, Airflow and Kafka','',''),(217,1,1,'An increasing volume of data is becoming available in biomedicine and healthcare, from genomic data, to electronic patient records and data collected by wearable devices. Recent advances in data science are transforming the life sciences, leading to precision medicine and stratified healthcare.','','data-science-in-stratified-healthcare-and-precision-medicine','','','','Data Science in Stratified Healthcare and Precision Medicine','',''),(218,1,1,'In this course you will apply various Data Analytics skills and techniques that you have learned as part of the previous courses in the IBM Data Analyst Professional Certificate. You will assume the role of an Associate Data Analyst who has recently joined the organization and be presented with a business challenge that requires data analysis to be performed on real-world datasets.','','ibm-data-analyst-capstone-project','','','','IBM Data Analyst Capstone Project','',''),(219,1,1,'This course will help institutions and individuals better manage the mental health challenges of being a healthcare worker.  Healthcare providers such as the University Health Network (UHN) address the mental health needs of their staff through several initiatives intended to help build resilience and to provide respite from the demands of their work.  This was critical during the pandemic but, of course, healthcare workers encounter high levels of stress even without a pandemic. The primary purpose of this course was to document and explain lessons learned with the hopes of informing healthcare institutions and healthcare workers about effective strategies and why they work.  Dr. Heather Gordon will highlight strategies she has employed within the UHN during the pandemic, and Professor Steve Joordens will discuss the psychology underlying these interventions.','','mental-health-and-resilience-for-healthcare-workers','','','','Mental Health and Resilience for Healthcare Workers','',''),(220,1,1,'In the third course of the Practical Data Science Specialization, you will learn a series of performance-improvement and cost-reduction techniques to automatically tune model accuracy, compare prediction performance, and generate new training data with human intelligence.  After tuning your text classifier using Amazon SageMaker Hyper-parameter Tuning (HPT), you will deploy two model candidates into an A/B test to compare their real-time prediction performance and automatically scale the winning model using Amazon SageMaker Hosting. Lastly, you will set up a human-in-the-loop pipeline to fix misclassified predictions and generate new training data using Amazon Augmented AI and Amazon SageMaker Ground Truth.','','optimize-ml-models-and-deploy-human-in-the-loop-pipelines','','','','Optimize ML Models and Deploy Human-in-the-Loop Pipelines','',''),(221,1,1,'Organizations need skilled, forward-thinking Big Data practitioners who can apply their business and technical skills to unstructured data such as tweets, posts, pictures, audio files, videos, sensor data, and satellite imagery and more to identify behaviors and preferences of prospects, clients, competitors, and others.','','data-engineering-and-machine-learning-using-spark','','','','Data Engineering and Machine Learning using Spark','',''),(222,1,1,'Обучение на размеченных данных или обучение с учителем – это наиболее распространенный класс задач машинного обучения. К нему относятся те задачи, где нужно научиться предсказывать некоторую величину для любого объекта, имея конечное число примеров. Это может быть предсказание уровня пробок на участке дороги, определение возраста пользователя по его действиям в интернете, предсказание цены, по которой будет куплена подержанная машина.','','obuchenie-na-razmechennykh-dannykh','','','','Обучение на размеченных данных','',''),(223,1,1,'This course covers a wide range of SQL techniques, beyond basic CRUD (Create, Read, Update, and Delete) operations in PostgreSQL. You will learn the specifics of aggregation, transactions, reading and parsing CSV files and inserting data into a database. You’ll also take a look at how PostgreSQL handles and indexes text data.','','intermediate-postgresql','','','','Intermediate PostgreSQL','',''),(224,1,1,'This course is focused on using the flexibility and “ease  of use” of TensorFlow 2.x and Keras to build, train, and deploy machine learning models.  You will learn about the TensorFlow 2.x API hierarchy and will get to know the main components of TensorFlow through hands-on exercises.  We will introduce you to working with datasets and feature columns. You will learn how to design and build a TensorFlow 2.x input data pipeline.  You will get hands-on practice loading csv data, numPy arrays, text data, and images using tf.Data.Dataset. You will also get hands-on practice creating numeric, categorical, bucketized, and hashed feature columns.','','introduction-to-tensorflow','','','','Introduction to TensorFlow','',''),(225,1,1,'In the first course of this specialization, we will recap what was covered in the  Machine Learning with TensorFlow on Google Cloud Platform Specialization (https://www.coursera.org/specializations/machine-learning-tensorflow-gcp).','','end-to-end-machine-learning-with-tensorflow-on-gcp','','','','End-to-End Machine Learning with TensorFlow on GCP','',''),(226,1,1,'The movement of bodies in space (like spacecraft, satellites, and space stations) must be predicted and controlled with precision in order to ensure safety and efficacy. Kinematics is a field that develops descriptions and predictions of the motion of these bodies in 3D space. This course in Kinematics covers four major topic areas: an introduction to particle kinematics, a deep dive into rigid body kinematics in two parts (starting with classic descriptions of motion using the directional cosine matrix and Euler angles, and concluding with a review of modern descriptors like quaternions and Classical and Modified Rodrigues parameters). The course ends with a look at static attitude determination, using modern algorithms to predict and execute relative orientations of bodies in space.','','kinematics-describing-the-motions-of-spacecraft','','','','Kinematics: Describing the Motions of Spacecraft','',''),(227,1,1,'Learn how to go from raw data to meaningful insights using AWS with this one-week course. Throughout the course, you’ll learn about the fundamentals of Data Analytics from AWS experts.','','getting-started-with-data-analytics-on-aws','','','','Getting Started with Data Analytics on AWS','',''),(228,1,1,'In this course, you will:','','generative-deep-learning-with-tensorflow','','','','Generative Deep Learning with TensorFlow','',''),(229,1,1,'The majority of data in the world is unlabeled and unstructured. Shallow neural networks cannot easily capture relevant structure in, for instance, images, sound, and textual data. Deep networks are capable of discovering hidden structures within this type of data. In this course you’ll use TensorFlow library to apply deep learning to different data types in order to solve real world problems.','','building-deep-learning-models-with-tensorflow','','','','Building Deep Learning Models with TensorFlow','',''),(230,1,1,'Welcome to Data Analytics Foundations for Accountancy I! You’re joining thousands of learners currently enrolled in the course. I\'m excited to have you in the class and look forward to your contributions to the learning community.','','data-analytics-foundations-for-accountancy-i','','','','Data Analytics Foundations for Accountancy I','',''),(231,1,1,'We will learn computational methods -- algorithms and data structures -- for analyzing DNA sequencing data. We will learn a little about DNA, genomics, and how DNA sequencing is used.  We will use Python to implement key algorithms and data structures and to analyze real genomes and DNA sequencing datasets.','','algorithms-for-dna-sequencing','','','','Algorithms for DNA Sequencing','',''),(232,1,1,'Welcome to this course on Getting started with TensorFlow 2!','','getting-started-with-tensorflow-2','','','','Getting started with TensorFlow 2','',''),(233,1,1,'Nanotechnology and nanosensors are broad, interdisciplinary areas that encompass (bio)chemistry, physics, biology, materials science, electrical engineering and more. The present course will provide a survey on some of the fundamental principles behind nanotechnology and nanomaterials and their vital role in novel sensing properties and applications. The course will discuss interesting interdisciplinary scientific and engineering knowledge at the nanoscale to understand fundamental physical differences at the nanosensors. By the end of the course, students will understand the fabrication, characterization, and manipulation of nanomaterials, nanosensors, and how they can be exploited for new applications. Also, students will apply their knowledge of nanotechnology and nanosensors to a topic of personal interest in this course.','','nanotechnology-and-nanosensors-part1','','','','Nanotechnology and Nanosensors, Part1','',''),(234,1,1,'This course provides a rigorous introduction to the R programming language, with a  particular focus on using R for software development in a data science setting. Whether you are part of a data science team or working individually within a community of developers, this course will give you the knowledge of R needed to make useful contributions in those settings. As the first course in the Specialization, the course provides the essential foundation of R needed for the following courses. We cover basic R concepts and language fundamentals, key concepts like tidy data and related \"tidyverse\" tools, processing and manipulation of complex and large datasets, handling textual data, and basic data science tasks. Upon completing this course, learners will have fluency at the R console and will be able to create tidy datasets from a wide range of possible data sources.','','the-r-programming-environment','','','','The R Programming Environment','',''),(235,1,1,'In this course, you will learn how to build Django-based web applications suitable for use by end users.  You will learn about cookies, sessions, and authentication processes in Django.  You will build navigation into your applications and explore ways to easily improve the look and feel of Django applications.  You will begin to develop a simple application to support a classified ads website that will walk you through many of the issues and techniques that you encounter in website development.  You will also learn how to move an application from development to production.','','django-features-and-libraries','','','','Django Features and Libraries','',''),(236,1,1,'Ce cours initie aux bases de la programmation en utilisant le langage C++ : variables, boucles, fonctions, ...','','initiation-a-la-programmation-en-c','','','','Initiation à la programmation (en C++)','',''),(237,1,1,'This is Class 2 of the MOOC Specialization, Become a Sustainable Business Change Agent.','','more-on-change-and-sustainability','','','','More on Change and Sustainability','',''),(238,1,1,'Основная цель курса — дать введение в разделы дискретной математики, важные для анализа данных.','','diskretnaya-matematika-podschety-grafy-sluchajnye-bluzhdaniya','','','','Дискретная математика: подсчеты, графы, случайные блуждания','',''),(239,1,1,'Want to know how you can improve the accuracy of your ML models? What about how to find which data columns make the most useful features? Welcome to Feature Engineering where we will discuss good vs bad features and how you can preprocess and transform them for optimal use in your models.','','feature-engineering','','','','Feature Engineering','',''),(240,1,1,'In this capstone, learners will apply their deep learning knowledge and expertise to a real world challenge.  They will use a library of their choice to develop and test a deep learning model. They will load and pre-process data for a real problem, build the model and validate it. Learners  will then present a project report to demonstrate the validity of their model and their proficiency in the field of Deep Learning.','','ai-capstone-project-with-deep-learning','','','','AI Capstone Project with Deep Learning','',''),(241,1,1,'Grande parte dos dados do mundo reside em bancos de dados. SQL (ou Structured Query Language) é uma linguagem poderosa usada para se comunicar e extrair dados de bancos de dados. Um conhecimento prático de bancos de dados e SQL é essencial se você deseja se tornar um cientista de dados.','','bancos-de-dados-e-sql-para-ciencia-de-dados','','','','Bancos de dados e SQL para Ciência de Dados','',''),(242,1,1,'Data is one of an organization’s most valuable commodities. But how can organizations best use their data? And how does the organization determine which data is the most recent, accurate, and useful for business decision making at the highest level?','','getting-started-with-data-warehousing-and-bi-analytics','','','','Getting Started with Data Warehousing and BI Analytics','',''),(243,1,1,'Counting is one of the basic mathematically related tasks we encounter on a day to day basis. The main question here is the following. If we need to count something, can we do anything better than just counting all objects one by one? Do we need to create a list of all phone numbers to ensure that there are enough phone numbers for everyone? Is there a way to tell that our algorithm will run in a reasonable time before implementing and actually running it? All these questions are addressed by a mathematical field called Combinatorics.','','combinatorics-and-probability','','','','Combinatorics and Probability','',''),(244,1,1,'This course introduces you to two of the most sought-after disciplines in Machine Learning: Deep Learning and Reinforcement Learning. Deep Learning is a subset of Machine Learning that has applications in both Supervised and Unsupervised Learning, and is frequently used to power most of the AI applications that we use on a daily basis. First you will learn about the theory behind Neural Networks, which are the basis of Deep Learning, as well as several modern architectures of Deep Learning. Once you have developed a few  Deep Learning models, the course will focus on Reinforcement Learning, a type of Machine Learning that has caught up more attention recently. Although currently Reinforcement Learning has only a few practical applications, it is a promising area of research in AI that might become relevant in the near future.','','deep-learning-and-reinforcement-learning','','','','Deep Learning and Reinforcement Learning','',''),(245,1,1,'The main goal of this course is to introduce topics in Discrete Mathematics relevant to Data Analysis.','','discrete-math-and-analyzing-social-graphs','','','','Discrete Math and Analyzing Social Graphs','',''),(246,1,1,'A learner will be able to write an application that leverages multiple Watson AI services (Discovery, Speech to Text, Assistant, and Text to Speech). By the end of the course, they’ll learn best practices of combining Watson services, and how they can build interactive information retrieval systems with Discovery + Assistant.','','building-ai-applications-with-watson-apis','','','','Building AI Applications with Watson APIs','',''),(247,1,1,'In this final course, we\'ll look at the JavaScript language and how it supports the Object-Oriented pattern, with a focus on the unique aspects of JavaScript\'s approach to OO. We\'ll provide an introduction to the jQuery library, which is widely used for in-browser manipulation of the Document Object Model (DOM) and event handling. You\'ll also learn about JavaScript Object Notation (JSON), which is commonly used as a syntax to exchange data between code running on the server (i.e., in Django) and code running in the browser (JavaScript/jQuery). You will continue to develop your classified ads application, adding features that make use of JavaScript, JQuery, and JSON.  This course assumes you have completed the first three courses in the specialization.','','using-javascript-jquery-and-json-in-django','','','','Using JavaScript, JQuery, and JSON in Django','',''),(248,1,1,'At the end of the course, you will be able to:','','big-data-integration-and-processing','','','','Big Data Integration and Processing','',''),(249,1,1,'&gt;&gt;&gt; By enrolling in this course you agree to the End User License Agreement as set out in the FAQ.  Once enrolled you can access the license in the Resources area &lt;&lt;','','applied-ai-with-deeplearning','','','','Applied AI with DeepLearning','',''),(250,1,1,'Bringing a machine learning model into the real world involves a lot more than just modeling. This Specialization will teach you how to navigate various deployment scenarios and use data more effectively to train your model.','','browser-based-models-with-tensorflowjs','','','','Browser-based Models with TensorFlow.js','',''),(251,1,1,'This is the first course of a six part specialization.  You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones.','','ai-workflow-business-priorities-and-data-ingestion','','','','AI Workflow: Business Priorities and Data Ingestion','',''),(252,1,1,'北京大学《C++程序设计》这门课将向你讲授C++程序设计有关的概念和语法，使你能够使用C++语言，以面向对象的方法编写可维护性、可扩充性好的，较大规模的程序。我们建议你在开始本课程之前已经熟悉了C语言和基本程设编写。这门课则将带你掌握C++语言中类、对象、运算符重载、继承、多态等面向对象的程序设计方法，以及模板、标准模板库STL等泛型程序设计的机制，体会和领悟面向对象程序设计方法和泛型程序设计方法的优势。','','c','','','','C++程序设计','',''),(253,1,1,'Machine learning is the foundation for predictive modeling and artificial intelligence. If you want to learn about both the underlying concepts and how to get into building models with the most common machine learning tools this path is for you. In this course, you will learn the core principles of machine learning and how to use common tools and frameworks to train, evaluate, and use machine learning models.','','create-machine-learning-models-in-microsoft-azure','','','','Create Machine Learning Models in Microsoft Azure','',''),(254,1,1,'In this course, you will learn how to harness the power of Apache Spark and powerful clusters running on the Azure Databricks platform to run data science workloads in the cloud.','','perform-data-science-with-azure-databricks','','','','Perform data science with Azure Databricks','',''),(255,1,1,'Case Study - Predicting Housing Prices','','machine-learning-regression','','','','Machine Learning: Regression','',''),(256,1,1,'Sports analytics now include massive datasets from athletes and teams that quantify both training and competition efforts.  Wearable technology devices are being worn by athletes everyday and provide considerable opportunities for an in-depth look at the stress and recovery of athletes across entire seasons.  The capturing of these large datasets has led to new hypotheses and strategies regarding injury prevention as well as detailed feedback for athletes to try and optimize training and recovery.','','wearable-technologies-and-sports-analytics','','','','Wearable Technologies and Sports Analytics','',''),(257,1,1,'Ongoing and proactive management is critical to the security and performance of database management systems.','','relational-database-administration-dba','','','','Relational Database Administration (DBA)','',''),(258,1,1,'Il corso Machine Learning e Data Mining in R è rivolto a chiunque voglia avere una pratica panoramica delle tecniche di apprendimento automatico, dalle più interpretabili - come l’analisi di regressione, delle componenti principali e dei gruppi - a quelle più flessibili come le reti neurali artificiali, sia shallow che deep - e le più ricorrenti problematiche di analisi e modellazione di dati e problemi reali - come collinearità, overfitting, regolarizzazione e knowledge transfer.','','machine-learning-e-data-miningin-r','','','','Machine Learning e Data Mining in R','',''),(259,1,1,'In this course, you will learn how to perform data engineering with Azure Synapse Apache Spark Pools, which enable you to boost the performance of big-data analytic applications by in-memory cluster computing.','','data-engineering-with-ms-azure-synapse-apache-spark-pools','','','','Data Engineering with MS Azure Synapse Apache Spark Pools','',''),(260,1,1,'We all learn numbers from the childhood. Some of us like to count, others hate it, but any person uses numbers everyday to buy things, pay for services, estimated time and necessary resources. People have been wondering about numbers’ properties for thousands of years. And for thousands of years it was more or less just a game that was only interesting for pure mathematicians. Famous 20th century mathematician G.H. Hardy once said “The Theory of Numbers has always been regarded as one of the most obviously useless branches of Pure Mathematics”. Just 30 years after his death, an algorithm for encryption of secret messages was developed using achievements of number theory. It was called RSA after the names of its authors, and its implementation is probably the most frequently used computer program in the word nowadays. Without it, nobody would be able to make secure payments over the internet, or even log in securely to e-mail and other personal services. In this short course, we will make the whole journey from the foundation to RSA in 4 weeks. By the end, you will be able to apply the basics of the number theory to encrypt and decrypt messages, and to break the code if one applies RSA carelessly. You will even pass a cryptographic quest!','','number-theory-and-cryptography','','','','Number Theory and Cryptography','',''),(261,1,1,'Functional programming is becoming increasingly widespread in industry. This trend is driven by the adoption of Scala as the main programming language for many applications. Scala fuses functional and object-oriented programming in a practical package. It interoperates seamlessly with both Java and Javascript. Scala is the implementation language of many important frameworks, including Apache Spark, Kafka, and Akka. It provides the core infrastructure for sites such as Twitter, Tumblr and also Coursera.','','functional-programming-principles-in-scala-scala-2-version','','','','Functional Programming Principles in Scala (Scala 2 version)','',''),(262,1,1,'Learn how to use Amazon CodeGuru Reviewer to automatically identify issues and vulnerabilities to improve your code quality with Improve your Python Code using Amazon CodeGuru. This course is designed for Python developers who are interested in learning how to use CodeGuru Reviewer to save time and improve their code review process.','','improve-your-java-code-using-amazon-codeguru','','','','Improve Your Java Code Using Amazon CodeGuru','',''),(263,1,1,'Not all programs are created equal.  In this course, we\'ll focus on writing quality code that runs correctly and efficiently.  We\'ll design, code and validate our programs and learn how to compare programs that are addressing the same task.','','learn-to-program-crafting-quality-code','','','','Learn to Program: Crafting Quality Code','',''),(264,1,1,'Gran parte de los datos del mundo residen en bases de datos. SQL (o lenguaje de consulta estructurado) es un lenguaje poderoso que se utiliza para comunicarse y extraer datos de bases de datos. Un conocimiento práctico de bases de datos y SQL es imprescindible si desea convertirse en un científico de datos.','','bases-de-datos-y-sql-para-ciencia-de-datos','','','','Bases de datos y SQL para ciencia de datos','',''),(265,1,1,'This is the fifth course in the IBM AI Enterprise Workflow Certification specialization.   You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones.','','ai-workflow-enterprise-model-deployment','','','','AI Workflow: Enterprise Model Deployment','',''),(266,1,1,'Bringing a machine learning model into the real world involves a lot more than just modeling. This Specialization will teach you how to navigate various deployment scenarios and use data more effectively to train your model.','','device-based-models-with-tensorflow-lite','','','','Device-based Models with TensorFlow Lite','',''),(267,1,1,'This course gives you access to the text mining techniques that are used by top data scientists from all over the world. Since most information available online in the form of text, knowing when and how to use these techniques, algorithms and models will not only give you an edge over your competition in the job market, but also allow you to see the world around you from a completely new perspective.','','introduction-to-text-mining-with-r','','','','Introduction to Text Mining with R','',''),(268,1,1,'The book Moneyball triggered a revolution in the analysis of performance statistics in professional sports, by showing that data analytics could be used to increase team winning percentage. This course shows how to program data using Python to test the claims that lie behind the Moneyball story, and to examine the evolution of Moneyball statistics since the book was published. The learner is led through the process of calculating baseball performance statistics from publicly available datasets. The course progresses from the analysis of on base percentage and slugging percentage to more advanced measures derived using the run expectancy matrix, such as wins above replacement (WAR). By the end of this course the learner will be able to use these statistics to conduct their own team and  player analyses.','','moneyball-and-beyond','','','','Moneyball and Beyond','',''),(269,1,1,'This is the third course of the Advanced Machine Learning on GCP specialization. In this course,','','image-understanding-with-tensorflow-on-gcp','','','','Image Understanding with TensorFlow on GCP','',''),(270,1,1,'In this course, we\'ll make predictions on product usage and calculate optimal safety stock storage. We\'ll start with a time series of shoe sales across multiple stores on three different continents. To begin, we\'ll look for unique insights and other interesting things we can find in the data by performing groupings and comparing products within each store. Then, we\'ll use a seasonal autoregressive integrated moving average (SARIMA) model to make predictions on future sales. In addition to making predictions, we\'ll analyze the provided statistics (such as p-score) to judge the viability of using the SARIMA model to make predictions. Then, we\'ll tune the hyper-parameters of the model to garner better results and higher statistical significance. Finally, we\'ll make predictions on safety stock by looking to the data for monthly usage predictions and calculating safety stock from the formula involving lead times.','','capstone-project-predicting-safety-stock','','','','Capstone Project: Predicting Safety Stock','',''),(271,1,1,'In this course students will explore supervised machine learning techniques using the python scikit learn (sklearn) toolkit and real-world athletic data to understand both machine learning algorithms and how to predict athletic outcomes. Building on the previous courses in the specialization, students will apply methods such as support vector machines (SVM), decision trees, random forest, linear and logistic regression, and ensembles of learners to examine data from professional sports leagues such as the NHL and MLB as well as wearable devices such as the Apple Watch and inertial measurement units (IMUs). By the end of the course students will have a broad understanding of how classification and regression techniques can be used to enable sports analytics across athletic activities and events.','','introduction-to-machine-learning-in-sports-analytics','','','','Introduction to Machine Learning in Sports Analytics','',''),(272,1,1,'Ключ к успешному развитию любой компании в современном мире — это умение делать быстрые и правильные решения, основываясь на данных. С каждым годом этих данных становится всё больше, при этом старые методы анализа перестают адекватно работать на таких объемах.','','obrabotka-bolshikh-dannykh','','','','Обработка больших данных','',''),(273,1,1,'Bringing a machine learning model into the real world involves a lot more than just modeling. This Specialization will teach you how to navigate various deployment scenarios and use data more effectively to train your model.','','data-pipelines-with-tensorflow-data-services','','','','Data Pipelines with TensorFlow Data Services','',''),(274,1,1,'Bringing a machine learning model into the real world involves a lot more than just modeling. This Specialization will teach you how to navigate various deployment scenarios and use data more effectively to train your model.','','advanced-deployment-scenarios-with-tensorflow','','','','Advanced Deployment Scenarios with TensorFlow','',''),(275,1,1,'This is the first course in the four-course specialization Python Data Products for Predictive Analytics, introducing the basics of reading and manipulating datasets in Python. In this course, you will learn what a data product is and go through several Python libraries to perform data retrieval, processing, and visualization.','','basic-data-processing-and-visualization','','','','Basic Data Processing and Visualization','',''),(276,1,1,'In this course you will apply a variety of data engineering skills and techniques you have learned as part of the previous courses in the IBM Data Engineering Professional Certificate. You will assume the role of a Junior Data Engineer who has recently joined the organization and be presented with a real-world use case that requires a data engineering solution.','','data-engineering-capstone-project','','','','Data Engineering Capstone Project','',''),(277,1,1,'Whether being used to customize advertising to millions of website visitors or streamline inventory ordering at a small restaurant, data is becoming more integral to success. Too often, we’re not sure how use data to find answers to the questions that will make us more successful in what we do. In this course, you will discover what data is and think about what questions you have that can be answered by the data – even if you’ve never thought about data before. Based on existing data, you will learn to develop a research question, describe the variables and their relationships, calculate basic statistics, and present your results clearly. By the end of the course, you will be able to use powerful data analysis tools – either SAS or Python – to manage and visualize your data, including how to deal with missing data, variable groups, and graphs. Throughout the course, you will share your progress with others to gain valuable feedback, while also learning how your peers use data to answer their own questions.','','data-management-and-visualization','','','','Data Management and Visualization','',''),(278,1,1,'BigQuery is Google\'s fully managed, NoOps, low-cost analytics database. With BigQuery you can query terabytes and terabytes of data without managing infrastructure or needing a database administrator. BigQuery uses SQL and takes advantage of the pay-as-you-go model. BigQuery allows you to focus on analyzing data to find meaningful insights.','','exploring-ncaa-data-with-bigquery','','','','Exploring NCAA Data with BigQuery','',''),(279,1,1,'Este curso se enfoca en aprovechar la flexibilidad y facilidad de uso de TensorFlow 2.x y Keras para compilar, entrenar e implementar modelos de aprendizaje automático.  Aprenderá sobre la jerarquía de la API de TensorFlow 2.x y conocerá los componentes principales de TensorFlow mediante ejercicios prácticos.  Le mostraremos cómo trabajar con conjuntos de datos y columnas de atributos. Aprenderá a diseñar y compilar una canalización de datos de entrada de TensorFlow 2.x.  Adquirirá experiencia práctica en la carga de arreglos de NumPy, imágenes y datos de texto con tf.data.Dataset, así como de datos de CSV con Pandas. También adquirirá experiencia práctica en la creación de columnas de atributos numéricas, categóricas, agrupadas en depósitos y con hash.','','intro-to-tensorflow-en-espanol','','','','Intro to TensorFlow en Español','',''),(280,1,1,'Modern applications that we build invariably have touch-points with its users through web-based and mobile platforms.  Users interact with the software through these interfaces and the experiences those interfaces provide have a strong influence on the perceived quality of the software.','','web-and-mobile-testing-with-selenium','','','','Web and Mobile Testing with Selenium','',''),(281,1,1,'Code and run your first Java program in minutes without installing anything!','','java-basics-selection-and-iteration','','','','Java Basics: Selection and Iteration','',''),(282,1,1,'|The Raspberry Pi uses a variety of input/output devices based on protocols such as HDMI, USB, and Ethernet to communicate with the outside world. In this class you will learn how to use these protocols with other external devices (sensors, motors, GPS, orientation, LCD screens etc.) to get your IoT device to interact with the real world. Most physical devices use analog signals','','interfacing-with-the-raspberry-pi','','','','Interfacing with the Raspberry Pi','',''),(283,1,1,'Este curso apresenta os conceitos mais importantes em torno do paradigma de desenvolvimento mais comum da indústria de software hoje: a Programação Orientação a Objetos (POO).','','laboratorio-de-programacao-orientada-a-objetos-parte-1','','','','Laboratório de Programação Orientada a Objetos - Parte 1','',''),(284,1,1,'تهدف هذه الدورة إلى تعليم الجميع أساسيات برمجة أجهزة الكمبيوتر باستخدام بايثون. إننا نغطي أساسيات كيفية إنشاء برنامج من سلسلة من التعليمات البسيطة في بايثون. لا يوجد متطلبات مسبقة للدورة التدريبية وهي لا تستخدم سوى أبسط قواعد الرياضيات. يجب أن يتمكن أي شخص لديه خبرة معتدلة في الكمبيوتر من إتقان المواد في هذه الدورة. تغطي هذه الدورة الفصول من 1 إلى 5 بالكتاب المقرر \"بايثون للجميع\". بمجرد إكمال الطالب للدورة التدريبية، سيكون جاهزًا لأخذ دورات تدريبية في البرمجة أكثر تقدمًا. تغطي هذه الدورة التدريبية بايثون 3.','','-','','','','البرمجة للجميع - بدء استخدام بايثون','',''),(285,1,1,'In recent years, owing to global competition and greater need of customers for safety, durability, and reliability of products, there has been a considerable tendency to improve quality in various industries. In this regard, fatigue is one of the major reasons of industrial failures, which is sometimes caused by lack of awareness or attention by the designer and other parts of industry like R&amp;D. The aim of this course is to introduce MSc graduates, Ph.D. students, and engineers working in industry with a short review of the basics of fatigue in different fields of engineering. To this end, it is attempted to express the general concept of the phenomenon using unconscious reactions of the human body to daily works and then to illustrate other aspects through simple examples. The topics cover common challenges that engineers should consider to study the causes of component failure.','','fatigue-failure-in-different-fields-of-engineering','','','','Fatigue Failure in Different Fields of Engineering','',''),(286,1,1,'Note: You should complete all the other courses in this Specialization before beginning this course.','','data-mining-project','','','','Data Mining Project','',''),(287,1,1,'Code and run your first Java program in minutes without installing anything!','','object-oriented-java-inheritance-and-encapsulation','','','','Object-Oriented Java: Inheritance and Encapsulation','',''),(288,1,1,'This course covers credential Access, discovery, lateral movement &amp; collection.','','credential-access-discovery-lateral-movement-collection','','','','Credential Access, discovery, lateral movement & collection','',''),(289,1,1,'Welcome to Natural Language Processing and Capstone Assignment. In this course we will begin with an Recognize how technical and business techniques can be used to deliver business insight, competitive intelligence, and consumer sentiment. The course concludes with a capstone assignment in which you will apply a wide range of what has been covered in this specialization.','','natural-language-processing-and-capstone-assignment','','','','Natural Language Processing and Capstone Assignment','',''),(290,1,1,'In this capstone project course, we\'ll compare genome sequences of COVID-19 mutations to identify potential areas a drug therapy can look to target. The first step in drug discovery involves identifying target subsequences of theirs genome to target. We\'ll start by comparing the genomes of virus mutations to look for similarities. Then, we\'ll perform PCA to cut down our number of dimensions and identify the most common features. Next, we\'ll use K-means clustering in Python to find the optimal number of groups and trace the lineage of the virus. Finally, we\'ll predict similarity between the sequences and use this to pick a target subsequence. Throughout the course, each section will consist of a programming assignment coupled with a guide video and helpful hints. By the end, you\'ll be well on your way to discovering ways to combat disease with genome sequencing.','','capstone-project-advanced-ai-for-drug-discovery','','','','Capstone Project: Advanced AI for Drug Discovery','',''),(291,1,1,'تعرف على كيفية تحليل البيانات باستخدام بايثون. تنتقل بك هذه الدورة بدءًا من أساسيات بايثون إلى استكشاف العديد من أنواع البيانات المختلفة. سوف تتعرف على كيفية إعداد البيانات للتحليل وإجراء تحليل إحصائي بسيط وإنشاء مؤثرات عرض بيانات ذات مغزى والتنبؤ بالاتجاهات المستقبلية التي يتم استنتاجها من البيانات، وغير ذلك المزيد!','','-','','','','تحليل البيانات باستخدام بايثون','',''),(292,1,1,'Este curso forma parte de una secuencia con la que se propone un acercamiento a la Matemática Preuniversitaria que prepara para la Matemática Universitaria.','','2-el-calculo-modelo-cuadratico','','','','2.- El Cálculo - Modelo Cuadrático','',''),(293,1,1,'Wenn auch Sie topaktuelle KI für sich nutzen möchten, sind Sie mit diesem Kurs auf dem richtigen Weg. Deep Learning-Pioniere sind vielgefragt und wenn Sie Deep Learning einmal gemeistert haben, stehen Ihnen zahlreiche Karrieremöglichkeiten offen. Deep Learning ist eine neue „Superkraft“, mit der Sie KI-Systeme entwickeln können, die so vor ein paar Jahren gar nicht möglich gewesen wären.','','neuronale-netze-und-deep-learning','','','','Neuronale Netze und Deep Learning','',''),(294,1,1,'このコースの目的は、柔軟で手軽な TensorFlow 2.x と Keras を使用して、機械学習モデルを作成、トレーニング、およびデプロイすることです。TensorFlow 2.x API の階層について学び、TensorFlow の主要コンポーネントを実践演習で理解します。データセットと特徴列の扱い方について学びます。TensorFlow 2.x 入力データ パイプラインの設計と作成の方法について学びます。tf.data.Dataset を使用して csv データ、NumPy 配列、テキストデータ、および画像を読み込む実践演習を行います。数値、カテゴリ、バケット、およびハッシュの特徴列を作成する実践演習も行います。','','intro-to-tensorflow-','','','','Intro to TensorFlow 日本語版','',''),(295,1,1,'By learning this course, you will get a comprehensive grasp of hashing  and typical balanced binary search trees, as well as their applications. By the end of this course, you will be able to understand the principle of Hashing, design and implement Hashtables for real problems, understand and implement typical balanced binary search trees such as Splay tree, Red-Black tree as well as B-tree, use BBST to solve various problems such as range query.','','data-structures-and-algorithms-iii','','','','Data Structures and Algorithms (III)','',''),(296,1,1,'This course is ideal for individuals who currently work in or are targeting opportunities in consulting and strategy, industrial sales and buying, marketing management, entrepreneurship and business development.','','marketing-channel-governance','','','','Marketing Channel Governance','',''),(297,1,1,'This is the final course in the Data Literacy Specialization.  In this capstone course, you\'ll apply the skills and knowledge you have acquired in the specialization to the critical evaluation of an original quantitative analysis.  The project will first require you to identify and read a piece of high-quality, original, quantitative research on a topic of your choosing.  You’ll then interpret and evaluate the findings as well as the methodological approach.  As part of the project, you’ll also review other students’ submissions.  By the end of the project, you should be empowered to be a critical consumer and user of quantitative research.','','data-literacy-capstone-evaluating-research','','','','Data Literacy Capstone – Evaluating Research','',''),(298,1,1,'ستمنحك دورة مشروع الكابستون هذه لمحة عما يمرّ به علماء البيانات في الحياة الواقعية عند التعامل مع البيانات.','','-','','','','كابستون علوم البيانات التطبيقية','',''),(299,1,1,'By learning this course, you will get a comprehensive grasp of Priority Queues and string match techniques, as well as their applications. By the end of this course, you will be able to understand/implement Bucketsort, Counting-sort, and Radixsort, understand the principle/implementation/application of different Priority Queues such as complete binary heap and leftist heap, understand and implement Heapsort, understand and implement typical string matching algorithms such as KMP, BM, and Karp-Rabin, implement and analyze advanced selection/sorting algorithms such as Quicksort, QuickSelect, LinearSelect, and Shellsort.','','data-structures-and-algorithms-iv','','','','Data Structures and Algorithms (IV)','',''),(300,1,1,'Este curso do projeto de conclusão mostrará um pouco do que os cientistas de dados passam na vida real ao trabalhar com dados.','','trabalho-de-conclusao-de-ciencia-de-dados-aplicada','','','','Trabalho de conclusão de Ciência de Dados Aplicada','',''),(301,1,1,'Этот заключительный курс позволит получить представление о том, как аналитики данных работают с данными в реальных условиях.','','zaklyuchitelnyj-kurs-po-teme-prikladnaya-nauka-o-dannykh','','','','Заключительный курс по теме «Прикладная наука о данных»','',''),(302,1,1,'El curso de Arquitecturas de Big Data busca que identifiques las características de una solución de Big Data, los datos asociados a estas soluciones, la infraestructura requerida, y las técnicas de procesamiento escalable. Desarrollaremos ejemplos usando infraestructuras basadas en Hadoop y en Spark, teniendo presente la pertinencia de las plataformas basadas en nube pública para soportar la escalabilidad de estas soluciones.','','arquitecturas-de-big-data','','','','Arquitecturas de Big Data','',''),(303,1,1,'This course takes a deep dive into the statistical foundation upon which Marketing Analytics is built.  The first part of this course is all about getting a thorough understanding of a dataset and gaining insight into what the data actually means.  The second part of this course goes into sampling and how to ask specific questions about your data.  Finally, the third part is about answering those questions with analyses.  Many of the mistakes made by Marketing Analysts today are caused by not understanding the concepts behind the analytics they run, which causes them to run the wrong test or misinterpret the results.  This course is specifically designed to give you the background you need to understand what you are doing and why you are doing it on a practical level.','','statistics-for-marketing','','','','Statistics for Marketing','',''),(304,1,1,'Не так давно получил распространение термин «большие данные», обозначивший новую прикладную область — поиск способов автоматического быстрого анализа огромных объёмов разнородной информации. Наука о больших данных ещё только оформляется, но уже сейчас она очень востребована — и в будущем будет востребована только больше.','','vvedenie-v-mashinnoe-obuchenie','','','','Введение в машинное обучение','',''),(305,1,1,'ابدأ تعلم لغة بايثون لعلوم البيانات، بالإضافة إلى البرمجة بوجه عام مع هذه المقدمة البسيطة للمبتدئين في تعلم لغة بايثون. تعتبر بايثون واحدة من أشهر لغات البرمجة في العالم، وهي تشهد إقبالاً غير مسبوق عليها من جانب المحترفين، حيث تمنحهم القدرة على تطبيق المبادئ الأساسية للغة بايثون لتطوير حلول الأعمال في مختلف الصناعات.','','-','','','','بايثون لعلوم البيانات والذكاء الصناعي','',''),(306,1,1,'AI is transforming the practice of medicine. It’s helping doctors diagnose patients more accurately, make predictions about patients’ future health, and recommend better treatments. As an AI practitioner, you have the opportunity to join in this transformation of modern medicine. If you\'re already familiar with some of the math and coding behind AI algorithms, and are eager to develop your skills further to tackle challenges in the healthcare industry, then this specialization is for you. No prior medical expertise is required!','','ai-for-medical-diagnosis','','','','AI for Medical Diagnosis','',''),(307,1,1,'In Course 4 of the Natural Language Processing Specialization, you will:','','natural-language-processing-with-attention-models','','','','Natural Language Processing with Attention Models','',''),(308,1,1,'Welcome to Introduction to Self-Driving Cars, the first course in University of Toronto’s Self-Driving Cars Specialization.','','introduction-to-self-driving-cars','','','','Introduction to Self-Driving Cars','',''),(309,1,1,'Go (golang) - современный язык программирования, предназначенный для разработки высококонкурентных приложений, работающих на многопроцессорных системах.','','razrabotka-veb-servisov-na-go-osnovy-yazyka','','','','Разработка веб-сервисов на Go - основы языка','',''),(310,1,1,'In this course, you\'ll explore the basic structure of a web application, and how a web browser interacts with a web server. You\'ll be introduced to the Hypertext Transfer Protocol (HTTP) request/response cycle, including GET/POST/Redirect. You\'ll also gain an introductory understanding of Hypertext Markup Language (HTML), as well as the overall structure of a Django application.  We will explore the Model-View-Controller (MVC) pattern for web applications and how it relates to Django.  You will learn how to deploy a Django application using a service like PythonAnywhere so that it is available over the Internet.','','web-application-technologies-and-django','','','','Web Application Technologies and Django','',''),(311,1,1,'|Science is undergoing a data explosion, and astronomy is leading the way. Modern telescopes produce terabytes of data per observation, and the simulations required to model our observable Universe push supercomputers to their limits. To analyse this data scientists need to be able to think computationally to solve problems. In this course you will investigate the challenges of working with large datasets: how to implement algorithms that work','','data-driven-astronomy','','','','Data-driven Astronomy','',''),(312,1,1,'In the second course of the Practical Data Science Specialization, you will learn to automate a natural language processing task by building an end-to-end machine learning pipeline using Hugging Face’s highly-optimized implementation of the state-of-the-art BERT algorithm with Amazon SageMaker Pipelines. Your pipeline will first transform the dataset into BERT-readable features and store the features in the Amazon SageMaker Feature Store. It will then fine-tune a text classification model to the dataset using a Hugging Face pre-trained model, which has learned to understand the human language from millions of Wikipedia documents. Finally, your pipeline will evaluate the model’s accuracy and only deploy the model if the accuracy exceeds a given threshold.','','build-train-and-deploy-ml-pipelines-using-bert','','','','Build, Train, and Deploy ML Pipelines using BERT','',''),(313,1,1,'Functional programming is becoming increasingly widespread in industry. This trend is driven by the adoption of Scala as the main programming language for many applications. Scala fuses functional and object-oriented programming in a practical package. It interoperates seamlessly with both Java and Javascript. Scala is the implementation language of many important frameworks, including Apache Spark, Kafka, and Akka. It provides the core infrastructure for sites such as Twitter, Netflix, Zalando, and also Coursera.','','functional-programming-principles-in-scala','','','','Functional Programming Principles in Scala','',''),(314,1,1,'|In this course, you will learn how to solve problems with large, high-dimensional, and potentially infinite state spaces. You will see that estimating value functions can be cast as a supervised learning problem---function approximation---allowing you to build agents that carefully balance generalization and discrimination in order to maximize reward. We will begin this journey by investigating how our policy evaluation or prediction methods like Monte Carlo and TD can be extended to the function approximation setting. You will learn about feature construction techniques for RL, and representation learning via neural networks and backprop. We conclude this course with a deep-dive into policy gradient methods','','prediction-and-control-with-function-approximation','','','','Prediction and Control with Function Approximation','',''),(315,1,1,'Go (golang) - современный язык программирования, предназначенный для разработки высококонкурентных приложений, работающих на многопроцессорных системах.','','razrabotka-veb-servisov-na-golang-chast-2','','','','Разработка веб-сервисов на Golang, часть 2','',''),(316,1,1,'In this course, we\'ll give you the tools to quickly identify and solve real-world problems that you might come across in your IT role. We\'ll look at a bunch of different strategies and approaches for tackling the most common pitfalls of your code and IT infrastructure. You\'ll learn strategies for approaching almost any technical problem and then see how those apply to solving different real-world scenarios.','','troubleshooting-and-debugging-techniques','','','','Troubleshooting and Debugging Techniques','',''),(317,1,1,'Learn the basics of Go, an open source programming language originally developed by a team at Google and enhanced by many contributors from the open source community. This course is designed for individuals with previous programming experience using such languages as C, Python, or Java, and covers the fundamental elements of Go. Topics include data types, protocols, formats, and writing code that incorporates RFCs and JSON. Most importantly, you’ll have a chance to practice writing Go programs and receive feedback from your peers. Upon completing this course, you\'ll be able to implement simple Go programs, which will prepare you for subsequent study at a more advanced level.','','getting-started-with-go','','','','Getting Started with Go','',''),(318,1,1,'In this course, you’ll learn about the fundamentals of trading, including the concept of trend, returns, stop-loss, and volatility. You will learn how to identify the profit source and structure of basic quantitative trading strategies. This course will help you gauge how well the model generalizes its learning, explain the differences between regression and forecasting, and identify the steps needed to create development and implementation backtesters. By the end of the course, you will be able to use Google Cloud Platform to build basic machine learning models in Jupyter Notebooks.','','introduction-to-trading-machine-learning-gcp','','','','Introduction to Trading, Machine Learning & GCP','',''),(319,1,1,'This course introduces you to one of the main types of modelling families of supervised Machine Learning: Regression. You will learn how to train regression models to predict continuous outcomes and how to use error metrics to compare across different models. This course also walks you through best practices, including train and test splits, and regularization techniques.','','supervised-machine-learning-regression','','','','Supervised Machine Learning: Regression','',''),(320,1,1,'Машинное обучение (Machine Learning, или ML) — это дисциплина о том, как на основе различных алгоритмов обучить компьютер распознавать, классифицировать и предсказывать объекты. Машинное обучение подарило нам эффективный поиск и персонализированный контент в интернете, а в последнее время активно используется в финансах и банковской сфере — наш курс именно об этом!','','mashinnoe-obuchenie-v-finansakh','','','','Машинное обучение в финансах','',''),(321,1,1,'Apache Spark is the de-facto standard for large scale data processing. This is the first course of a series of courses towards the IBM Advanced Data Science Specialization. We strongly believe that is is crucial for success to start learning a scalable data science platform since memory and CPU constraints are to most limiting factors when it comes to building advanced machine learning models.','','fundamentals-of-scalable-data-science','','','','Fundamentals of Scalable Data Science','',''),(322,1,1,'In modern cloud native application development, it’s oftentimes the goal to build out serverless architectures that are scalable, are highly available, and are fully managed. This means less operational overhead for you and your business, and more focusing on the applications and business specific projects that differentiate you in your marketplace. In this course, we will be covering how to build a modern, greenfield serverless backend on AWS.','','building-modern-nodejs-applications-on-aws','','','','Building Modern Node.js Applications on AWS','',''),(323,1,1,'Digital Signal Processing is the branch of engineering that, in the space of just a few decades, has enabled unprecedented levels of interpersonal communication and of on-demand entertainment. By reworking the principles of electronics, telecommunication and computer science into a unifying paradigm, DSP is a the heart of the digital revolution that brought us CDs, DVDs, MP3 players, mobile phones and countless other devices.','','digital-signal-processing-1-basic-concepts-and-algorithms','','','','Digital Signal Processing 1: Basic Concepts and Algorithms','',''),(324,1,1,'A modern VLSI chip has a zillion parts -- logic, control, memory, interconnect, etc.  How do we design these complex chips?  Answer: CAD software tools.  Learn how to build thesA modern VLSI chip is a remarkably complex beast:  billions of transistors, millions of logic gates deployed for computation and control, big blocks of memory, embedded blocks of pre-designed functions designed by third parties (called “intellectual property” or IP blocks).  How do people manage to design these complicated chips?  Answer: a sequence of computer aided design (CAD) tools takes an abstract description of the chip, and refines it step-wise to a final design. This class focuses on the major design tools used in the creation of an Application Specific Integrated Circuit (ASIC) or System on Chip (SoC) design. Our focus in this first part of the course is on key Boolean logic representations that make it possible to synthesize, and to verify, the gate-level logic in these designs.  This is the first step of the design chain, as we move from logic to layout.    Our goal is for students to understand how the tools themselves work, at the level of their fundamental algorithms and data structures. Topics covered will include: Computational Boolean algebra, logic verification, and logic synthesis (2-level and multi-level).','','vlsi-cad-part-i-logic','','','','VLSI CAD Part I: Logic','',''),(325,1,1,'This course provides an introduction to the Java language and object-oriented programming, including an overview of Java syntax and how it differs from a language like Python.  Students will learn how to write custom Java classes and methods, and how to test their code using unit testing and test-driven development.  Topics include basic data structures like Arrays and ArrayLists and overloading methods.','','introduction-to-java-and-object-oriented-programming','','','','Introduction to Java and Object-Oriented Programming','',''),(326,1,1,'In modern cloud native application development, it’s oftentimes the goal to build out serverless architectures that are scalable, are highly available, and are fully managed. This means less operational overhead for you and your business, and more focusing on the applications and business specific projects that differentiate you in your marketplace. In this course, we will be covering how to build a modern, greenfield serverless backend on AWS.','','building-modern-java-applications-on-aws','','','','Building Modern Java Applications on AWS','',''),(327,1,1,'Welcome to Motion Planning for Self-Driving Cars, the fourth course in University of Toronto’s Self-Driving Cars Specialization.','','motion-planning-for-self-driving-cars','','','','Motion Planning for Self-Driving Cars','',''),(328,1,1,'Welcome to the second course in the Building Cloud Computing Solutions at Scale Specialization! In this course, you will learn to design Cloud-native systems with the fundamental building blocks of Cloud computing. These building blocks include virtual machines and containers. You will also learn how to build effective Microservices using technologies like Flask and Kubernetes. Finally, you will analyze successful patterns in Operations including: Effective alerts, load testing and Kaizen.','','cloud-virtualization-containers-and-apis','','','','Cloud Virtualization, Containers and APIs','',''),(329,1,1,'While telling stories with data has been part of the news practice since its earliest days, it is in the midst of a renaissance. Graphics desks which used to be deemed as “the art department,” a subfield outside the work of newsrooms, are becoming a core part of newsrooms’ operation. Those people (they often have various titles: data journalists, news artists, graphic reporters, developers, etc.) who design news graphics are expected to be full-fledged journalists and work closely with reporters and editors. The purpose of this class is to learn how to think about the visual presentation of data, how and why it works, and how to doit the right way. We will learn how to make graphs like The New York Times, Vox, Pew, and FiveThirtyEight. In the end, you can share–embed your beautiful charts in publications, blog posts, and websites.','','visualization-for-data-journalism','','','','Visualization for Data Journalism','',''),(330,1,1,'この 2 週間の速習オンデマンド コースでは、Google Cloud Platform（GCP）のビッグデータ機能と機械学習機能を紹介します。Google Cloud Platform の概要を簡単に説明した後、データ処理機能について詳しく説明します。','','google-cloud-big-data-and-machine-learning-fundamentals-','','','','Google Cloud Big Data and Machine Learning Fundamentals 日本語版','',''),(331,1,1,'In this course you will learn how to apply the functional programming style in the design of larger Scala applications. You\'ll get to know important new functional programming concepts, from lazy evaluation to structuring your libraries using monads. We\'ll work on larger and more involved examples, from state space exploration to random testing to discrete circuit simulators. You’ll also learn some best practices on how to write good Scala code in the real world. Finally, you will learn how to leverage the ability of the compiler to infer values from types.','','functional-program-design-in-scala','','','','Functional Program Design in Scala','',''),(332,1,1,'This course focuses on computational methods in option and interest rate, product’s pricing and model calibration. The first module will introduce different types of options in the market, followed by an in-depth discussion into numerical techniques helpful in pricing them, e.g. Fourier Transform (FT) and Fast Fourier Transform (FFT) methods. We will explain models like Black-Merton-Scholes (BMS), Heston, Variance Gamma (VG), which are central to understanding stock price evolution, through case studies and Python codes. The second module introduces concepts like bid-ask prices, implied volatility, and option surfaces, followed by a demonstration of model calibration for fitting market option prices using optimization routines like brute-force search, Nelder-Mead algorithm, and BFGS algorithm. The third module introduces interest rates and the financial products built around these instruments. We will bring in fundamental concepts like forward rates, spot rates, swap rates, and the term structure of interest rates, extending it further for creating, calibrating, and analyzing LIBOR and swap curves. We will also demonstrate the pricing of bonds, swaps, and other interest rate products through Python codes. The final module focuses on real-world model calibration techniques used by practitioners to estimate interest rate processes and derive prices of different financial products. We will illustrate several regression techniques used for interest rate model calibration and end the module by covering the Vasicek and CIR model for pricing fixed income instruments.','','computational-methods-in-pricing-and-model-calibration','','','','Computational Methods in Pricing and Model Calibration','',''),(333,1,1,'This intermediate-level course introduces the mathematical foundations to derive Principal Component Analysis (PCA), a fundamental dimensionality reduction technique. We\'ll cover some basic statistics of data sets, such as mean values and variances, we\'ll compute distances and angles between vectors using inner products and derive orthogonal projections of data onto lower-dimensional subspaces. Using all these tools, we\'ll then derive PCA as a method that minimizes the average squared reconstruction error between data points and their reconstruction.','','mathematics-for-machine-learning-pca','','','','Mathematics for Machine Learning: PCA','',''),(334,1,1,'В этом онлайн-курсе мы будем смотреть на данные через призму математической статистики. Поговорим о том, какое место она занимает среди наук о данных. Научимся аккуратно переводить повседневные задачи на язык статистики и выбирать методы для работы с ними.','','matematicheskaya-statistika-i-a-v-testirovanie','','','','Математическая статистика и А/В тестирование','',''),(335,1,1,'Completing this first level will enable you to rapidly create moderately complex business applications using 1C:Enterprise’s large range of predefined objects. Take this course to learn the ins and outs of the 1C:Enterprise platform. It is the initial step in learning how to develop using the 1C:Enterprise platform. Complete it before taking other 1C:Enterprise application development courses.','','1c-enterprise-junior-developer-course','','','','1C:Enterprise Junior Developer Course','',''),(336,1,1,'The essentials of application development are accessing, processing, and presenting data. Data is stored in various databases, either on-premise or on the cloud, and developers will need to learn how to talk to them via programming languages.','','developing-applications-with-sql-databases-and-django','','','','Developing Applications with SQL, Databases, and Django','',''),(337,1,1,'Welcome to \"CCAI Conversational Design Fundamentals\", the first course in the \"Customer Experiences with Contact Center AI\" series.','','contact-center-ai-conversational-design-fundamentals','','','','Contact Center AI: Conversational Design Fundamentals','',''),(338,1,1,'Welcome to the third course in the Building Cloud Computing Solutions at Scale Specialization! In this course, you will learn how to apply Data Engineering to real-world projects using the Cloud computing concepts introduced in the first two courses of this series. By the end of this course, you will be able to develop Data Engineering applications and use software development best practices to create data engineering applications. These will include continuous deployment, code quality tools, logging, instrumentation and monitoring. Finally, you will use Cloud-native technologies to tackle complex data engineering solutions.','','cloud-data-engineering','','','','Cloud Data Engineering','',''),(339,1,1,'Welcome to this course on Customising your models with TensorFlow 2!','','customising-your-models-with-tensorflow-2','','','','Customising your models with TensorFlow 2','',''),(340,1,1,'You should complete the VLSI CAD Part I: Logic course before beginning this course.','','vlsi-cad-part-ii-layout','','','','VLSI CAD Part II: Layout','',''),(341,1,1,'Digital Signal Processing is the branch of engineering that, in the space of just a few decades, has enabled unprecedented levels of interpersonal communication and of on-demand entertainment. By reworking the principles of electronics, telecommunication and computer science into a unifying paradigm, DSP is a the heart of the digital revolution that brought us CDs, DVDs, MP3 players, mobile phones and countless other devices.','','digital-signal-processing-2-filtering','','','','Digital Signal Processing 2: Filtering','',''),(342,1,1,'В машинном обучении встречаются задачи, где нужно изучить структуру данных, найти в них скрытые взаимосвязи и закономерности. Например, нам может понадобиться описать каждого клиента банка с помощью меньшего количества переменных — для этого можно использовать методы понижения размерности, основанные на матричных разложениях. Такие методы пытаются сформировать новые признаки на основе старых, сохранив как можно больше информации в данных. Другим примером может служить задача тематического моделирования, в которой для набора текстов нужно построить модель, объясняющую процесс формирования этих текстов из небольшого количества тем.','','poisk-struktury-v-dannykh','','','','Поиск структуры в данных','',''),(343,1,1,'In the final course from the Machine Learning for Trading specialization, you will be introduced to reinforcement learning (RL) and the benefits of using reinforcement learning in trading strategies. You will learn how RL has been integrated with neural networks and review LSTMs and how they can be applied to time series data. By the end of the course, you will be able to build trading strategies using reinforcement learning, differentiate between actor-based policies and value-based policies, and incorporate RL into a momentum trading strategy.','','reinforcement-learning-for-trading-strategies','','','','Reinforcement Learning for Trading Strategies','',''),(344,1,1,'In modern cloud native application development, it’s oftentimes the goal to build out serverless architectures that are scalable, are highly available, and are fully managed. This means less operational overhead for you and your business, and more focusing on the applications and business specific projects that differentiate you in your marketplace. In this course, we will be covering how to build a modern, greenfield serverless backend on AWS.','','building-modern-net-applications-on-aws','','','','Building Modern .NET Applications on AWS','',''),(345,1,1,'|Сейчас термины “машинное обучение” или даже “искусственный интеллект” у всех на слуху. Местами это преувеличение и хайп, но у машинного обучения действительно есть много полезных и важных применений. Вы сталкиваетесь с этим каждый день: когда вы ищете что-то в интернете, поисковик предлагает вам странички на основе сложного сопоставления текстов и анализа ваших данных','','osnovy-mashinnogo-obucheniya','','','','Основы машинного обучения','',''),(346,1,1,'Case Studies: Analyzing Sentiment &amp; Loan Default Prediction','','machine-learning-classification','','','','Machine Learning: Classification','',''),(347,1,1,'Влияет ли знание методов анализа данных на уровень заработной платы? Работает ли система оценки кредитоспособности клиентов банка? Действительно ли новый баннер лучше старого? Чтобы ответить на такие вопросы, нужно собрать данные. Данные почти всегда содержат шум, поэтому утверждения, которые можно сделать на их основе, верны не всегда, а только с определённой вероятностью. Строить наиболее корректные выводы и численно оценивать степень уверенности в них помогают методы статистики.','','postroenie-vyvodov-po-dannym','','','','Построение выводов по данным','',''),(348,1,1,'Методы машинного обучения — будь то алгоритмы классификации или регрессии, методы кластеризации или алгоритмы понижения размерности — применяются к подготовленным данным с вычисленными признаками для решения уже сформулированной задачи. Однако специалисты по анализу данных редко оказываются в такой идеальной ситуации. Обычно перед ними ставят задачи, которые нуждаются в уточнении формулировки, выборе метрики качества и протокола тестирования итоговой модели. Данные, с которыми нужно работать, часто представлены в непригодном виде: они зашумлены, содержат ошибки и выбросы, хранятся в неудобном формате и т. д.','','prikladnye-zadachi-analiza-dannykh','','','','Прикладные задачи анализа данных','',''),(349,1,1,'¿Cuáles son algunas de las herramientas de ciencia de datos más populares, cómo las usa y cuáles son sus características? En este curso, aprenderá sobre Jupyter Notebooks, RStudio IDE, Apache Zeppelin y Data Science Experience. Aprenderá para qué se utiliza cada herramienta, qué lenguajes de programación pueden ejecutar, sus características y limitaciones. Con las herramientas alojadas en la nube en Cognitive Class Labs, podrá probar cada herramienta y seguir las instrucciones para ejecutar código simple en Python, R o Scala. Para finalizar el curso, creará un proyecto final con un Jupyter Notebook en IBM Data Science Experience y demostrará su competencia preparando un cuaderno, escribiendo Markdown y compartiendo su trabajo con sus compañeros.','','herramientas-para-la-ciencia-de-datos','','','','Herramientas para la ciencia de datos','',''),(350,1,1,'Основная особенность курса — геометрический подход к изложению. В каждом сюжете сначала мы рассказываем идею определения, пусть иногда и нестрого, а уже затем вводим формальное определение. В частности, линейные операторы, собственные векторы и числа появляются до матриц и определителей. Матрицы мы излагаем как способ записи линейного оператора. В силу этой особенности курс может быть интересен и тем, кто уже освоил стандартный вводный курс линейной алгебры.','','linejnaya-algebra-ot-idei-k-formule','','','','Линейная алгебра: от идеи к формуле','',''),(351,1,1,'Digital Signal Processing is the branch of engineering that, in the space of just a few decades, has enabled unprecedented levels of interpersonal communication and of on-demand entertainment. By reworking the principles of electronics, telecommunication and computer science into a unifying paradigm, DSP is a the heart of the digital revolution that brought us CDs, DVDs, MP3 players, mobile phones and countless other devices.','','digital-signal-processing-3-analog-vs-digital','','','','Digital Signal Processing 3: Analog vs Digital','',''),(352,1,1,'In this course you will learn how to apply the functional programming style in the design of larger Scala applications. You\'ll get to know important new functional programming concepts, from lazy evaluation to structuring your libraries using monads. We\'ll work on larger and more involved examples, from state space exploration to random testing to discrete circuit simulators. You’ll also learn some best practices on how to write good Scala code in the real world. Finally, you will learn how to leverage the ability of the compiler to infer values from types.','','functional-program-design-in-scala-scala-2-version','','','','Functional Program Design in Scala (Scala 2 version)','',''),(353,1,1,'In this course you get the chance to get teaching and hands-on experience with the complete workflow of high-resolution tomography analysis. You will get introduced to data acquisition, 3D reconstruction, segmentation and meshing and, finally, 3D modelling of data to extract physical parameters describing mechanical and flow properties. The teaching and the exercises will take place in close interaction with top experts in the field. Exercises will require some basic programming skills, and will be carried out in a common python environment.','','introduction-to-advanced-tomography','','','','Introduction to advanced tomography','',''),(354,1,1,'Welcome to the fourth course in the Building Cloud Computing Solutions at Scale Specialization! In this course, you will build upon the Cloud computing and data engineering concepts introduced in the first three courses to apply Machine Learning Engineering to real-world projects. First, you will develop Machine Learning Engineering applications and use software development best practices to create Machine Learning Engineering applications. Then, you will learn to use AutoML to solve problems more efficiently than traditional machine learning approaches alone. Finally, you will dive into emerging topics in Machine Learning including MLOps, Edge Machine Learning and AI APIs.','','cloud-machine-learning-engineering-and-mlops','','','','Cloud Machine Learning Engineering and MLOps','',''),(355,1,1,'|We invite you to a fascinating journey into Graph Theory — an area which connects the elegance of painting and the rigor of mathematics','','introduction-to-graph-theory','','','','Introduction to Graph Theory','',''),(356,1,1,'Este curso te brindará los conocimientos introductorios sobre el procesamiento de lenguaje natural y las diversas tareas relacionadas al pre procesamiento de grandes volúmenes de texto.','','introduccion-al-procesamiento-de-lenguaje-natural','','','','Introducción al procesamiento de lenguaje natural','',''),(357,1,1,'In this project you will demonstrate the skills that you have mastered in cloud native application development. You will apply your new knowledge to a real-life challenge and use your expertise to develop a successful solution.','','full-stack-cloud-development-capstone-project','','','','Full Stack Cloud Development Capstone Project','',''),(358,1,1,'Azure Machine Learning is a cloud platform for training, deploying, managing, and monitoring machine learning models. In this course, you will learn how to use the Azure Machine Learning Python SDK to create and manage enterprise-ready ML solutions.','','build-and-operate-machine-learning-solutions-with-azure','','','','Build and Operate Machine Learning Solutions with Azure','',''),(359,1,1,'Digital Signal Processing is the branch of engineering that, in the space of just a few decades, has enabled unprecedented levels of interpersonal communication and of on-demand entertainment. By reworking the principles of electronics, telecommunication and computer science into a unifying paradigm, DSP is a the heart of the digital revolution that brought us CDs, DVDs, MP3 players, mobile phones and countless other devices.','','digital-signal-processing-4-applications','','','','Digital Signal Processing 4: Applications','',''),(360,1,1,'Welcome to \"Virtual Agent Development in Dialogflow CX for Software Devs\", the third course in the \"Customer Experiences with Contact Center AI\" series.','','virtual-agent-development-in-dialogflow-cx-for-software-devs','','','','Virtual Agent Development in Dialogflow CX for Software Devs','',''),(361,1,1,'Welcome to \"CCAI Operations and Implementation\", the fourth course in the \"Customer Experiences with Contact Center AI\" series.','','contact-center-ai-operations-and-implementation','','','','Contact Center AI: Operations and Implementation','',''),(362,1,1,'This course equips you with a practical understanding and a framework to guide the execution of basic analytics tasks such as pulling, cleaning, manipulating and analyzing data by introducing you to the OSEMN cycle for analytics projects. You’ll learn to perform data analytics tasks using spreadsheet and SQL queries. You will also be introduced to using the Python programming language to manipulate datasets as an alternative to spreadsheets. You will learn foundational programming concepts and how they apply to marketing. You will also learn how to use Tableau to create data visualizations and dashboards.','','introduction-to-data-analytics','','','','Introduction to Data Analytics','',''),(363,1,1,'By the end of this course, learners are provided a high-level overview of data analysis and visualization tools, and are prepared to discuss best practices and develop an ensuing action plan that addresses key discoveries. It begins with common hurdles that obstruct adoption of a data-driven culture before introducing data analysis tools (R software, Minitab, MATLAB, and Python). Deeper examination is spent on statistical process control (SPC), which is a method for studying variation over time. The course also addresses do’s and don’ts of presenting data visually, visualization software (Tableau, Excel, Power BI), and creating a data story.','','data-analysis-and-visualization','','','','Data Analysis and Visualization','',''),(364,1,1,'Machine learning is at the core of artificial intelligence, and many modern applications and services depend on predictive machine learning models. Training a machine learning model is an iterative process that requires time and compute resources. Automated machine learning can help make it easier. In this course, you will learn how to use Azure Machine Learning to create and publish models without writing code.','','microsoft-azure-machine-learning-for-data-scientists','','','','Microsoft Azure Machine Learning for Data Scientists','',''),(365,1,1,'With every smartphone and computer now boasting multiple processors, the use of functional ideas to facilitate parallel programming is becoming increasingly widespread. In this course, you\'ll learn the fundamentals of parallel programming, from task parallelism to data parallelism. In particular, you\'ll see how many familiar ideas from functional programming map perfectly to to the data parallel paradigm. We\'ll start the nuts and bolts how to effectively parallelize familiar collections operations, and we\'ll build up to parallel collections, a production-ready data parallel collections library available in the Scala standard library. Throughout, we\'ll apply these concepts through several hands-on examples that analyze real-world data, such as popular algorithms like k-means clustering.','','parallel-programming','','','','Parallel programming','',''),(366,1,1,'This course is the second in a specialization for Machine Learning for Supply Chain Fundamentals. In this course, we explore all aspects of time series, especially for demand prediction. We\'ll start by gaining a foothold in the basic concepts surrounding time series, including stationarity, trend (drift), cyclicality, and seasonality. Then, we\'ll spend some time analyzing correlation methods in relation to time series (autocorrelation). In the 2nd half of the course, we\'ll focus on methods for demand prediction using time series, such as autoregressive models. Finally, we\'ll conclude with a project, predicting demand using ARIMA models in Python.','','demand-forecasting-using-time-series','','','','Demand Forecasting Using Time Series','',''),(367,1,1,'In Object-Oriented Concepts, we will introduce the core concepts behind modern, object-oriented, programming.  We will discuss objects, classes, messaging, inheritance, polymorphism, and more.  As with Fundamentals of Programming, we will illustrate the concepts using the Python language, but they will be portable to other object-oriented programming languages.','','application-programming-fundamentals','','','','Application Programming Fundamentals','',''),(368,1,1,'Анализ данных позволяет получить ценную информацию из больших и разнообразных наборов данных.','','podgotovka-i-analiz-dannykh-v-tableau','','','','Подготовка и анализ данных в Tableau','',''),(369,1,1,'This is the sixth course in the IBM AI Enterprise Workflow Certification specialization.   You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones.    ','','ai-workflow-ai-in-production','','','','AI Workflow: AI in Production','',''),(370,1,1,'This is the second course in the IBM AI Enterprise Workflow Certification specialization.  You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones.  ','','ai-workflow-data-analysis-and-hypothesis-testing','','','','AI Workflow: Data Analysis and Hypothesis Testing','',''),(371,1,1,'This course can also be taken for academic credit as ECEA 5348, part of CU Boulder’s Master of Science in Electrical Engineering degree.','','m2m-iot-interface-design-protocols-for-embedded-systems','','','','M2M & IoT Interface Design & Protocols for Embedded Systems','',''),(372,1,1,'Bienvenidos a esta introducción al desarrollo de videojuegos en Unity! Al finalizar este curso habrás desarrollado un juego 2D sencillo, y conocerás los conceptos necesarios para hacer este desarrollo desde el punto de vista de un programador en Unity. Aprenderás durante 8 semanas cómo crear la escena principal de un juego, cómo agregar código que defina el comportamiento de los personajes, cómo reflejar el estado del juego en elementos de interfaz y cómo publicar dicho prototipo en la web. Usamos Unity, un motor de juegos muy popular, con una gran cantidad de recursos disponibles y con una comunidad muy activa. Puedes ver ejemplos de lo que han desarrollado otros estudiantes en: http://padlet.com/Uniandes/DlloVideojuegos','','desarrollo-de-videojuegos-en-unity-una-introduccion','','','','Desarrollo de Videojuegos en Unity: Una Introducción','',''),(373,1,1,'En este curso a pedido y acelerado de 1 semana, los participantes descubrirán las capacidades de los macrodatos y del aprendizaje automático de Google Cloud Platform (GCP). Además, se proporciona una descripción general rápida de Google Cloud Platform y más detalles sobre las capacidades de procesamiento de datos.','','google-cloud-big-data-and-machine-learning-fundamentals-en-espanol','','','','Google Cloud Big Data and Machine Learning Fundamentals en Español','',''),(374,1,1,'This course takes you from understanding the fundamentals of a machine learning project. Learners will understand and implement supervised learning techniques on real case studies to analyze business case scenarios where decision trees, k-nearest neighbours and support vector machines are optimally used. Learners will also gain skills to contrast the practical consequences of different data preparation steps and describe common production issues in applied ML.','','machine-learning-algorithms-supervised-learning-tip-to-tail','','','','Machine Learning Algorithms: Supervised Learning Tip to Tail','',''),(375,1,1,'This course synthesizes everything your have learned in the applied machine learning specialization. You will now walk through a complete machine learning project to prepare a machine learning maintenance roadmap. You will understand and analyze how to deal with changing data. You will also be able to identify and interpret potential unintended effects in your project. You will understand and define procedures to operationalize and maintain your applied machine learning model. By the end of this course you will have all the tools and understanding you need to confidently roll out a machine learning project and prepare to optimize it in your business context.','','optimizing-machine-learning-performance','','','','Optimizing Machine Learning Performance','',''),(376,1,1,'Финальный проект даст вам возможность применить полученные в рамках специализации знания к задаче из реального мира. Под руководством успешных специалистов в науке о данных вы сможете поработать над актуальным проектом в одной из областей: электронная коммерция, социальные медиа, информационный поиск, бизнес-аналитика и др.','','analiz-dannykh-finalnyj-proekt','','','','Анализ данных: финальный проект','',''),(377,1,1,'This is the third course in the IBM AI Enterprise Workflow Certification specialization.    You are STRONGLY encouraged to complete these courses in order as they are not individual independent courses, but part of a workflow where each course builds on the previous ones.  ','','ai-workflow-feature-engineering-and-bias-detection','','','','AI Workflow: Feature Engineering and Bias Detection','',''),(378,1,1,'In this course, application developers learn how to design and develop cloud-native applications that seamlessly integrate managed services from Google Cloud. Through a combination of presentations, demos, and hands-on labs, participants learn how to apply best practices for application development and use the appropriate Google Cloud storage services for object storage, relational data, caching, and analytics. Learners can choose to complete labs in their favorite language: Node.js, Java, or Python.','','securing-and-integrating-components-of-your-application','','','','Securing and Integrating Components of your Application','',''),(379,1,1,'In this course, application developers learn how to design and develop cloud-native applications that seamlessly integrate managed services from Google Cloud. Through a combination of presentations, demos, and hands-on labs, participants learn how to apply best practices for application development and use the appropriate Google Cloud storage services for object storage, relational data, caching, and analytics. Learners can choose to complete labs in their favorite language: Node.js, Java, or Python.','','app-deployment-debugging-and-performance','','','','App Deployment, Debugging, and Performance','',''),(380,1,1,'Welcome to \"CCAI Virtual Agent Development in Dialogflow ES for Software Developers\", the third course in the \"Customer Experiences with Contact Center AI\" series.','','virtual-agent-development-in-dialogflow-es-for-software-devs','','','','Virtual Agent Development in Dialogflow ES for Software Devs','',''),(381,1,1,'Agile embraces change which means that team should be able to effectively make changes to the system as team learns about users and market.  To be good at effectively making changes to the system, teams need to have engineering rigor and excellence else embracing change becomes very painful and expensive.','','engineering-practices-for-building-quality-software','','','','Engineering Practices for Building Quality Software','',''),(382,1,1,'This is the second course in the four-course specialization Python Data Products for Predictive Analytics, building on the data processing covered in Course 1 and introducing the basics of designing predictive models in Python. In this course, you will understand the fundamental concepts of statistical learning and learn various methods of building predictive models. At each step in the specialization, you will gain hands-on experience in data manipulation and building your skills, eventually culminating in a capstone project encompassing all the concepts taught in the specialization.','','design-thinking-and-predictive-analytics-for-data-products','','','','Design Thinking and Predictive Analytics for Data Products','',''),(383,1,1,'Welcome to \"CCAI Virtual Agent Development in Dialogflow CX for Citizen Developers\", the second course in the \"Customer Experiences with Contact Center AI\" series.','','virtual-agent-development-in-dialogflow-cx-for-citizen-devs','','','','Virtual Agent Development in Dialogflow CX for Citizen Devs','',''),(384,1,1,'This course is a continuation of Python for Cybersecurity. The topics covered are execution, persistence, privilege escalation and evasion.','','execution-persistence-privilege-escalation-and-evasion','','','','Execution, persistence, privilege escalation and evasion','',''),(385,1,1,'Microsoft certifications give you a professional advantage by providing globally recognized and industry-endorsed evidence of mastering skills in digital and cloud businesses.​​ In this course, you will prepare to take the DP-100 Azure Data Scientist Associate certification exam.','','prepare-for-dp-100-data-science-on-microsoft-azure-exam','','','','Prepare for DP-100: Data Science on Microsoft Azure Exam','',''),(386,1,1,'This course is aimed at anyone interested in applying machine learning techniques to scientific problems. In this course, we\'ll learn about the complete machine learning pipeline, from reading in, cleaning, and transforming data to running basic and advanced machine learning algorithms. We\'ll start with data preprocessing techniques, such as PCA and LDA. Then, we\'ll dive into the fundamental AI algorithms: SVMs and K-means clustering. Along the way, we\'ll build our mathematical and programming toolbox to prepare ourselves to work with more complicated models. Finally, we\'ll explored advanced methods such as random forests and neural networks. Throughout the way, we\'ll be using medical and astronomical datasets. In the final project, we\'ll apply our skills to compare different machine learning models in Python.','','machine-learning-models-in-science','','','','Machine Learning Models in Science','',''),(387,1,1,'Ce cours intensif à la demande, d\'une durée d\'une semaine, présente aux participants les fonctionnalités de big data et de machine learning de Google Cloud Platform (GCP). Il présente rapidement Google Cloud Platform et explique plus en détail les fonctionnalités de traitement des données.','','google-cloud-big-data-and-machine-learning-fundamentals-en-francais','','','','Google Cloud Big Data and Machine Learning Fundamentals en Français','',''),(388,1,1,'El curso trata de resolución automática de problemas por medio de algoritmos de búsqueda.','','resolucion-de-problemas-por-busqueda','','','','Resolución de problemas por búsqueda','',''),(389,1,1,'This two-part course builds upon the programming skills that you learned in our Introduction to Interactive Programming in Python course.  We will augment those skills with both important programming practices and critical mathematical problem solving skills.  These skills underlie larger scale computational problem solving and programming. The main focus of the class will be programming weekly mini-projects in Python that build upon the mathematical and programming principles that are taught in the class. To keep the class fun and engaging, many of the projects will involve working with strategy-based games.','','principles-of-computing-part-1','','','','Principles of Computing (Part 1)','',''),(390,1,1,'Este curso de proyecto final le dará una idea de lo que atraviesan los científicos de datos en la vida real cuando trabajan con datos.','','ciencia-de-datos-aplicada-curso-capstone','','','','Ciencia de Datos Aplicada - Curso Capstone','',''),(391,1,1,'The objective of this course is to introduce Computational Statistics to aspiring or new data scientists. The attendees will start off by learning the basics of probability, Bayesian modeling and inference. This will be the first course in a specialization of three courses .Python and Jupyter notebooks will be used throughout this course to illustrate and perform Bayesian modeling. The course website is located at https://sjster.github.io/introduction_to_computational_statistics/docs/index.html. The course notebooks can be downloaded from this website by following the instructions on page https://sjster.github.io/introduction_to_computational_statistics/docs/getting_started.html.','','introduction-to-bayesian-statistics','','','','Introduction to Bayesian Statistics','',''),(392,1,1,'The objective of this course is to introduce Markov Chain Monte Carlo Methods for Bayesian modeling and inference,  The attendees will start off by learning the the basics of Monte Carlo methods. This will be augmented by hands-on examples in Python that will be used to illustrate how these algorithms work. This will be the second course in a specialization of three courses .Python and Jupyter notebooks will be used throughout this course to illustrate and perform Bayesian modeling with PyMC3. The course website is located at https://sjster.github.io/introduction_to_computational_statistics/docs/index.html. The course notebooks can be downloaded from this website by following the instructions on page https://sjster.github.io/introduction_to_computational_statistics/docs/getting_started.html.','','bayesian-inference-with-mcmc','','','','Bayesian Inference with MCMC','',''),(393,1,1,'In this course, you will develop and test hypotheses about your data. You will learn a variety of statistical tests, as well as strategies to know how to apply the appropriate one to your specific data and question. Using your choice of two powerful statistical software packages (SAS or Python), you will explore ANOVA, Chi-Square, and Pearson correlation analysis. This course will guide you through basic statistical principles to give you the tools to answer questions you have developed. Throughout the course, you will share your progress with others to gain valuable feedback and provide insight to other learners about their work.','','data-analysis-tools','','','','Data Analysis Tools','',''),(394,1,1,'This course focuses on one of the most important tools in your data analysis arsenal: regression analysis. Using either SAS or Python, you will begin with linear regression and then learn how to adapt when two variables do not present a clear linear relationship. You will examine multiple predictors of your outcome and be able to identify confounding variables, which can tell a more compelling story about your results. You will learn the assumptions underlying regression analysis, how to interpret regression coefficients, and how to use regression diagnostic plots and other tools to evaluate the quality of your regression model. Throughout the course, you will share with others the regression models you have developed and the stories they tell you.','','regression-modeling-in-practice','','','','Regression Modeling in Practice','',''),(395,1,1,'The objective of this course is to introduce PyMC3 for Bayesian Modeling and Inference,  The attendees will start off by learning the the basics of PyMC3 and learn how to perform scalable inference for a variety of problems. This will be the final course in a specialization of three courses .Python and Jupyter notebooks will be used throughout this course to illustrate and perform Bayesian modeling with PyMC3.. The course website is located at https://sjster.github.io/introduction_to_computational_statistics/docs/index.html. The course notebooks can be downloaded from this website by following the instructions on page https://sjster.github.io/introduction_to_computational_statistics/docs/getting_started.html.','','introduction-to-pymc3-for-bayesian-modeling-and-inference','','','','Introduction to PyMC3 for Bayesian Modeling and Inference','',''),(396,1,1,'In this course you will learn about audio signal processing methodologies that are specific for music and of use in real applications. We focus on the spectral processing techniques of relevance for the description and transformation of sounds, developing the basic theoretical and practical knowledge with which to analyze, synthesize, transform and describe audio signals in the context of music applications.','','audio-signal-processing-for-music-applications','','','','Audio Signal Processing for Music Applications','',''),(397,1,1,'Experienced Computer Scientists analyze and solve computational problems at a level of abstraction that is beyond that of any particular programming language.  This two-part class is designed to train students in the mathematical concepts and process of \"Algorithmic Thinking\", allowing them to build simpler, more efficient solutions to computational problems.','','algorithmic-thinking-part-2','','','','Algorithmic Thinking (Part 2)','',''),(398,1,1,'This two-part course introduces the basic mathematical and programming principles that underlie much of Computer Science. Understanding these principles is crucial to the process of creating efficient and well-structured solutions for computational problems.  To get hands-on experience working with these concepts, we will use the Python programming language. The main focus of the class will be weekly mini-projects that build upon the mathematical and programming principles that are taught in the class. To keep the class fun and engaging, many of the projects will involve working with strategy-based games.','','principles-of-computing-part-2','','','','Principles of Computing (Part 2)','',''),(399,1,1,'Mathematical Matrix Methods lie at the root of most methods of machine learning and data analysis of tabular data.  Learn the basics of Matrix Methods, including matrix-matrix multiplication, solving linear equations, orthogonality, and best least squares approximation.   Discover the Singular Value Decomposition that plays a fundamental role in dimensionality reduction, Principal Component Analysis, and noise reduction.  Optional examples using Python are used to illustrate the concepts and allow the learner to experiment with the algorithms.','','matrix-methods','','','','Matrix Methods','',''),(400,1,1,'In this introductory course you will get both a full overview of what TDD is, when it can and can\'t be applied, and what its benefits are for practitioners and organizations. You will also have the opportunity to get hands on with a few fun introductory projects where you can apply what you have learned and experience the benefits of this approach to problem solving yourself.','','test-driven-development-overview','','','','Test-Driven Development Overview','',''),(401,1,1,'このコースでは、アプリケーション デベロッパーが、Google Cloud のマネージド サービスをシームレスに統合するクラウドネイティブ アプリケーションを設計、開発する方法を学習します。プレゼンテーション、デモ、ハンズオンラボを通して、受講者はアプリケーション開発にベスト プラクティスを適用する方法と、オブジェクト ストレージ、リレーショナル データ、キャッシュ、分析に、適切な Google Cloud ストレージ サービスを使用する方法を学習します。受講者は、Node.js、Java、Python のいずれかの言語を選択してラボを完了できます。','','securing-and-integrating-components-of-your-application-','','','','Securing and Integrating Components of your Application 日本語版','',''),(402,1,1,'Este curso intensivo sob demanda tem duração de uma semana e apresentará as funcionalidades de Big Data e Machine Learning do Google Cloud Platform (GCP). Ele fornecerá uma visão geral rápida do Google Cloud Platform e mostrará em detalhes os recursos do processamento de dados.','','google-cloud-platform-big-data-and-machine-learning-fundamentals-em-portugues-brasileiro','','','','Google Cloud Platform Big Data and Machine Learning Fundamentals em Português Brasileiro','',''),(403,1,1,'このアプリケーション デベロッパー向けのコースでは、Google Cloud のマネージド サービスをシームレスに統合するクラウドネイティブ アプリケーションを設計、開発する方法を学びます。プレゼンテーション、デモ、ハンズオンラボを通して、受講者はアプリケーション開発のベスト プラクティスを適用する方法と、オブジェクト ストレージ、リレーショナル データ、キャッシュ、分析向けに、適切な Google Cloud ストレージ サービスを使用する方法を学習します。受講者は、Node.js、Java、Python のいずれか好きな言語を選択してラボを完了できます。','','application-deployment-debug-performance-','','','','Application Deployment, Debug, Performance 日本語版','',''),(404,1,1,'To be a proficient developer you need to have a solid grasp of test writing before putting code into production. In this course, we will take a hands-on look at Test-Driven Development by writing and implementing tests as soon as week one. TDD starts with good unit tests, so we will start there. Topics will also cover translating user specs into unit tests, applying the Red-Green-Refactor mantra, and applying mocks in python with the unittest.mock module. Once finished, you will have covered all the steps of TDD before development','','a-practical-introduction-to-test-driven-development','','','','A Practical Introduction to Test-Driven Development','',''),(405,1,1,'El razonamiento formal juega un papel importante en la inteligencia artificial. Hay dos maneras principales de formalizar razonamiento: una que enfatiza la deducción (lógica), y otra que enfatiza la incertidumbre (teoría de la probabilidad). En este curso vamos a cubrir una introducción tanto a la lógica (vamos a cubrir tres lógicas) como a la teoría de la probabilidad (vamos a cubrir tres modelos gráficos probabilísticos).','','razonamiento-artificial','','','','Razonamiento artificial','',''),(406,1,1,'Code and run Django websites without installing anything!','','advanced-django-building-a-blog','','','','Advanced Django: Building a Blog','',''),(407,1,1,'The capstone project of the Modern Robotics specialization is on mobile manipulation: simultaneously controlling the motion of a wheeled mobile base and its robot arm to achieve a manipulation task.  This project integrates several topics from the specialization, including trajectory planning, odometry for mobile robots, and feedback control.  Beginning from the Modern Robotics software library provided to you (written in Python, Mathematica, and MATLAB), and software you have written for previous courses, you will develop software to plan and control the motion of a mobile manipulator to perform a pick and place task.  You will test your software on the KUKA youBot, a mobile manipulator consisting of an omnidirectional mecanum-wheel mobile base, a 5-joint robot arm, and a gripper.  The state-of-the-art, cross-platform V-REP robot simulator will be used to simulate the task.','','modern-robotics-course-6-capstone-project-mobile-manipulation','','','','Modern Robotics, Course 6:  Capstone Project, Mobile Manipulation','',''),(408,1,1,'In our 6 week Robotics Capstone, we will give you a chance to implement a solution for a real world problem based on the content you learnt from the courses  in your robotics specialization. It  will also give you a chance to use mathematical and programming methods that researchers use in robotics labs.','','robotics-capstone','','','','Robotics: Capstone','',''),(409,1,1,'In this course we will discuss how to integrate best practices of test-driven development into your programming workflow. We will start out by discussing how to refactor legacy codebases with the help of agile methodologies. Then, we will explore continuous integration and how to write automated tests in Python. Finally, we will work everything we\'ve learned together to write code that contains error handlers, automated tests, and refactored functions.','','integrating-test-driven-development-into-your-workflow','','','','Integrating Test-Driven Development into Your Workflow','',''),(410,1,1,'With every smartphone and computer now boasting multiple processors, the use of functional ideas to facilitate parallel programming is becoming increasingly widespread. In this course, you\'ll learn the fundamentals of parallel programming, from task parallelism to data parallelism. In particular, you\'ll see how many familiar ideas from functional programming map perfectly to to the data parallel paradigm. We\'ll start the nuts and bolts how to effectively parallelize familiar collections operations, and we\'ll build up to parallel collections, a production-ready data parallel collections library available in the Scala standard library. Throughout, we\'ll apply these concepts through several hands-on examples that analyze real-world data, such as popular algorithms like k-means clustering.','','parallel-programming-scala-2-version','','','','Parallel programming (Scala 2 version)','',''),(411,1,1,'Welcome to \"Virtual Agent Development in Dialogflow ES for Citizen Devs\", the second course in the \"Customer Experiences with Contact Center AI\" series.','','virtual-agent-development-in-dialogflow-es-for-citizen-devs','','','','Virtual Agent Development in Dialogflow ES for Citizen Devs','',''),(412,1,1,'¿Qué es la creatividad? ¿Pueden ser creativas las computadoras? ¿Cómo, cuándo y con qué objetivo surgió esta nueva área de investigación? ¿Hasta dónde hemos llegado en la creación de sistemas “creativos” y qué teorías, metodologías y técnicas podemos usar para programar y evaluar este tipo de sistemas en generación de narrativas, música, descubrimiento científico, artes visuales, etcétera?','','creatividad-computacional','','','','Creatividad computacional','',''),(413,1,1,'Este curso te brindará los conocimientos necesarios para la extracción, limpieza y preparación de distintas fuentes de datos para ser incluidos en un proceso de NLP.','','limpieza-de-datos-para-el-procesamiento-de-lenguaje-natural','','','','Limpieza de datos para el procesamiento de lenguaje natural','','');
